		public static int GetIterateOnSingle(int trigger)
		{
			return iterateOnSingle.ContainsKey(trigger) ? iterateOnSingle[trigger] : -1;
		}

		public static int GetTableBufferBasedonTrigger(int trigger)
		{
			return listToBuffer.ContainsKey(trigger) ? listToBuffer[trigger].Item1 : -1;
		}

		public static void Iterate(SLProtocol protocol, int trigger)
		{
			if (!iterateBuffer.ContainsKey(trigger))
			{
				throw new ArgumentException("Trigger not found in Iterate Buffer Dictionary");
			}

			object[] data = (object[])protocol.GetParameters(new[] { iterateBuffer[trigger].Item1, iterateBuffer[trigger].Item2 });

			string uriBase = Convert.ToString(data[0]);

			IEnumerable<string> keysToIterate = Convert.ToString(data[1]).Split(new[] { ';' }, StringSplitOptions.RemoveEmptyEntries);
			if (!keysToIterate.Any())
			{
				return;
			}

			string requestUri = uriBase + keysToIterate.Last() + "/";

			keysToIterate = keysToIterate.Take(keysToIterate.Count() - 1);

			protocol.SetParameters(
				new[] { (int)iterateBuffer[trigger].Item2, iterateBuffer[trigger].Item3 },
				new object[] { keysToIterate == null ? String.Empty : String.Join(";", keysToIterate), requestUri });
			protocol.CheckTrigger(iterateBuffer[trigger].Item3);
		}

		public static bool IterateOnSingleContainsKey(int trigger)
		{
			return iterateOnSingle.ContainsKey(trigger);
		}

		public static bool ListToBufferContainsKey(int trigger)
		{
			return listToBuffer.ContainsKey(trigger);
		}

		public static void SetNewBuffer(SLProtocol protocol, int trigger, IEnumerable<string> keys)
		{
			int pid = listToBuffer[trigger].Item2;

			protocol.SetParameter(pid, String.Join(";", keys));
			protocol.CheckTrigger(listToBuffer[trigger].Item2);
		}
	}

	public static partial class Parser
	{
		private static readonly JavaScriptSerializer serializer = new JavaScriptSerializer();

		public static void Chassis(SLProtocol protocol, string response)
		{
			JsonObjects.Chassis.RootObject jsonData = serializer.Deserialize<JsonObjects.Chassis.RootObject>(response);

			if (jsonData == null)
			{
				throw new FormatException("|Received data is in an unexpected format. Response received:" + response);
			}

			List<object[]> fans = new List<object[]>();
			List<object[]> temperatures = new List<object[]>();
			List<object[]> smartBatteries = new List<object[]>();
			Dictionary<int, object> dataToSet = new Dictionary<int, object>();

			int totalPowerConsumedW = -1;
			string redundancyMode = Constants.DefaultValue;

			bool nullPower = jsonData.Power == null;

			if (!nullPower)
			{
				if (jsonData.Power.PowerControl != null)
				{
					totalPowerConsumedW = jsonData.Power.PowerControl.Sum(x => x.PowerConsumedWatts);
				}

				JsonObjects.Chassis.Redundancy firstRedundancy = jsonData.Power.Redundancy?.FirstOrDefault();
				if (firstRedundancy != null && !String.IsNullOrWhiteSpace(firstRedundancy.Mode))
				{
					redundancyMode = firstRedundancy.Mode;
				}
			}

			dataToSet.Add(Parameter.presentpowerreading_527, totalPowerConsumedW);
			dataToSet.Add(Parameter.powerredundancymode_528, redundancyMode);

			protocol.SetParameters(dataToSet.Keys.ToArray(), dataToSet.Values.ToArray());

			if (nullPower || jsonData.Power.PowerSupplies == null || !jsonData.Power.PowerSupplies.Any())
			{
				protocol.Log("QA" + protocol.QActionID + "|No Power Supplies Available|", LogType.Information, LogLevel.Level1);
			}
			else
			{
				List<object[]> powerSupplies = new List<object[]>();
				CreatePowerSupplyRows(jsonData, powerSupplies);

				protocol.FillArray(Parameter.Powersupplies.tablePid, powerSupplies, NotifyProtocol.SaveOption.Full);
			}

			bool nullThermal = jsonData.Thermal == null;

			if (!nullThermal && jsonData.Thermal.Fans != null)
			{
				CreateFanRows(jsonData, fans);
			}

			protocol.FillArray(Parameter.Fans.tablePid, fans, NotifyProtocol.SaveOption.Full);

			if (!nullThermal && jsonData.Thermal.Temperatures != null)
			{
				CreateTemperatureRows(jsonData, temperatures);
			}

			protocol.FillArray(Parameter.Temperatures.tablePid, temperatures, NotifyProtocol.SaveOption.Full);

			if (jsonData.Oem?.Hpe?.SmartStorageBattery != null)
			{
				CreateSmartStorageBatteryRows(jsonData, smartBatteries);
			}

			protocol.FillArray(Parameter.Smartstoragebattery.tablePid, smartBatteries, NotifyProtocol.SaveOption.Full);
		}

		public static void FirmwareInfo(SLProtocol protocol, string response)
		{
			JsonObjects.FirmwareInfo.RootObject firmwaredata = serializer.Deserialize<JsonObjects.FirmwareInfo.RootObject>(response);
