		public static void JsonApiIloEventLog(SLProtocol protocol, string response)
		{
			JsonObjects.EventLog.RootObject iloEventResponse = serializer.Deserialize<JsonObjects.EventLog.RootObject>(response);

			if (iloEventResponse?.Events == null || iloEventResponse.Events.Count == 0)
			{
				protocol.SetParameter(Parameter.urigetiloeventlogjsonapi_1041, "json/ilo_event_log/page/0");
				return;
			}

			object[] data = (object[])protocol.GetParameters(
				new uint[] { Parameter.iloeventlognumberofentries_2008, Parameter.iloeventlogoldestrecord_2009, Parameter.iloeventpollingexcludeloginmsg_4201 });

			double tableSizeLimit = Convert.ToDouble(data[0]);
			if (tableSizeLimit <= 0)
			{
				protocol.ClearAllKeys(Parameter.Iloeventlog.tablePid);
				return;
			}

			double oldestRecord = Convert.ToDouble(data[1]);
			bool excludeLoginMessages = Convert.ToBoolean(Convert.ToInt32(data[2]));

			// This will sort data from oldest to newest.
			SortedList<int?, IloeventlogQActionRow> retrievedEntries = new SortedList<int?, IloeventlogQActionRow>();

			double initialUpdate = ParseToOADateOrDefault(iloEventResponse.Events[0].Initial_update, "MM/dd/yyyy HH:mm:ss", -1);

			// Items are sorted by oldest to newest.
			if (initialUpdate > oldestRecord || Math.Abs(oldestRecord) < 0.001)
			{
				CreateIloEventLogRows(iloEventResponse, tableSizeLimit, retrievedEntries, excludeLoginMessages);
			}

			if (retrievedEntries.Count > 0)
			{
				oldestRecord = Convert.ToDouble(retrievedEntries.ElementAt(0).Value.Iloeventloginitialupdate_2204);
				int? nextKeyToPoll = retrievedEntries.Last().Key + 1;
				FillIloEventLogTable(protocol, tableSizeLimit, retrievedEntries, excludeLoginMessages);

				if (retrievedEntries.Count > 0)
				{
					protocol.SetParameters(
						new[] { Parameter.iloeventlogoldestrecord_2009, Parameter.urigetiloeventlogjsonapi_1041 },
						new object[] { oldestRecord, "json/ilo_event_log/page/" + nextKeyToPoll });
					protocol.CheckTrigger(1041);
				}
			}
			else
			{
				FillIloEventLogTable(protocol, tableSizeLimit, retrievedEntries, excludeLoginMessages);
			}
		}

		public static void JsonApiLoginSession(SLProtocol protocol, string response)
		{
			JsonObjects.LoginData logindata = serializer.Deserialize<JsonObjects.LoginData>(response);

			if (logindata == null || String.IsNullOrWhiteSpace(logindata.Session_key))
			{
				protocol.Log("QA" + protocol.QActionID + "|JSON API|" + protocol.GetTriggerParameter() + "Login Failure|", LogType.Error, LogLevel.NoLogging);
				protocol.SetParameter(Parameter.jsonapisessionkey_104, String.Empty);
				return;
			}

			protocol.SetParameters(
				new[] { Parameter.jsonapisessionkey_104, Parameter.postcleariloeventlogrequestdatajsonapi_1843 },
				new object[] { logindata.Session_key, "{\"method\":\"clear\",\"session_key\":\"" + logindata.Session_key + "\"}" });
		}

		public static void Managers(SLProtocol protocol, string response)
		{
			// protocol.Log("QA" + protocol.QActionID + "|Managers|Message\n" + response, LogType.DebugInfo, LogLevel.NoLogging);
			response = response.Replace("\"#", "\"");
			response = response.Replace("Manager.Reset", "ManagerReset");
			response = response.Replace("HpiLO.", "HpiLO");
			response = response.Replace("ResetType@Redfish.", "ResetTypeRedfish");

			JsonObjects.Managers.RootObject managers = serializer.Deserialize<JsonObjects.Managers.RootObject>(response);

			if (managers == null)
			{
				throw new FormatException("|Received data is in an unexpected format. Response received:" + response);
			}

			Dictionary<int, object> dataToSet = new Dictionary<int, object>
			{
				{ Parameter.ilofwversion_511, managers.FirmwareVersion ?? Constants.DefaultValue },
			};

			if (managers.Oem?.Hpe?.License?.LicenseString == null)
			{
				dataToSet.Add(Parameter.licensetype_510, Constants.DefaultValue);
			}
			else
			{
				dataToSet.Add(Parameter.licensetype_510, managers.Oem.Hpe.License.LicenseString);
			}

			protocol.SetParameters(dataToSet.Keys.ToArray(), dataToSet.Values.ToArray());

			List<object[]> diagList = new List<object[]>();

			if (managers.Oem?.Hpe?.IloSelfTestResults != null)
			{
				CreateDiagnosticRows(managers, diagList);
			}

			if (diagList.Count > 0)
			{
				protocol.FillArray(Parameter.Diagnostics.tablePid, diagList, NotifyProtocol.SaveOption.Full);
			}
		}

		public static void ManagersEmbeddedMedia(SLProtocol protocol, string response)
		{
			JsonObjects.ManagersEmbeddedMedia.RootObject embeddedMedia = serializer.Deserialize<JsonObjects.ManagersEmbeddedMedia.RootObject>(response);

			if (embeddedMedia == null)
