			if (embeddedMedia.SDCard?.Status == null)
			{
				status = "Not Present";
			}
			else
			{
				status = embeddedMedia.SDCard.Status.State == "Enabled" ? "Present: " + Math.Round(embeddedMedia.SDCard.SizeMB / 1024.00, 2) + " GB" : "Not Present";
			}

			Dictionary<int, object> dataToSet = new Dictionary<int, object>
			{
				{ Parameter.sdcardstatus_531, status },
			};

			protocol.SetParameters(dataToSet.Keys.ToArray(), dataToSet.Values.ToArray());
		}

