		public static void PciInfo(SLProtocol protocol, string response)
		{
			JsonObjects.PciInfo.RootObject pciInfoObject = serializer.Deserialize<JsonObjects.PciInfo.RootObject>(response);

			List<object[]> inventory = new List<object[]>();

			int idx = 0;
			if (pciInfoObject.inventory != null)
			{
				foreach (var item in pciInfoObject.inventory)
				{
					if (item == null)
					{
						continue;
					}

					DeviceinventoryQActionRow device = new DeviceinventoryQActionRow();
					device.Deviceinventoryindex_4101 = idx++;
					device.Deviceinventoryproductname_4102 = item.name;
					device.Deviceinventorylocation_4103 = item.location;
					device.Deviceinventoryproductpartnumber_4104 = item.part_num;
					device.Deviceinventoryassemblynumber_4105 = item.board_num;
					device.Deviceinventoryserialnumber_4106 = item.serial_num;
					device.Deviceinventoryproductversion_4107 = item.version;
					device.Deviceinventoryfirmwareversion_4108 = item.firmware;
					device.Deviceinventorystatus_4109 = item.status;
					device.Deviceinventoryslottype_4110 = item.slot_type ?? "N/A";
					device.Deviceinventoryslotbuswidth_4111 = item.slot_bus_width ?? "N/A";
					device.Deviceinventoryslotlength_4112 = item.slot_length ?? "N/A";

					inventory.Add(device);
				}
			}

			protocol.FillArray(Parameter.Deviceinventory.tablePid, inventory, NotifyProtocol.SaveOption.Full);
		}

