		/// <summary>
		///     IML Entries are retrieved page by page.
		///     HP holds 30 entries per page.
		///     The protocol will loop through all pages and get only the IntegratedManagementLogNumberOfEntries most recent
		///     entries.
		/// </summary>
		/// <param name="protocol">Link with DataMiner.</param>
		/// <param name="response">HTTP Reply Body.</param>
		public static void Systems(SLProtocol protocol, string response)
		{
			JsonObjects.Systems.RootObject systems = serializer.Deserialize<JsonObjects.Systems.RootObject>(response);

			if (systems == null)
			{
				throw new FormatException("|Received data is in an unexpected format. Response received:" + response);
			}

			if (systems.Members == null)
			{
				return;
			}

			if (systems.Members.Count > 1)
			{
				protocol.Log("QA" + protocol.QActionID + "|WARNING: More than one member was found. This system has structure with dimension > 1.", LogType.Error, LogLevel.NoLogging);
				foreach (var item in systems.Members)
				{
					if (item == null)
					{
						continue;
					}

					protocol.Log("QA" + protocol.QActionID + "|ID:" + item.Data_id.Replace("/redfish/v1/Systems/", String.Empty).Replace("/", String.Empty), LogType.Error, LogLevel.NoLogging);
				}
			}
		}

		public static void SystemsLogServicesIml(SLProtocol protocol, string response)
		{
			JsonObjects.LogServicesImlLog.RootObject log = serializer.Deserialize<JsonObjects.LogServicesImlLog.RootObject>(response);

			if (log?.Members == null)
			{
				protocol.Log("QA" + protocol.QActionID + "|JSON API|" + protocol.GetTriggerParameter() + "Login Failure|", LogType.Error, LogLevel.NoLogging);
				return;
			}

			object[] data = (object[])protocol.GetParameters(new uint[] { Parameter.integratedmanagementlognumberofentries_2005, Parameter.integratedmanagementlogoldestrecord_2006 });

			double tableSizeLimit = Convert.ToDouble(data[0]);
			if (tableSizeLimit <= 0)
			{
				protocol.ClearAllKeys(Parameter.Integratedmanagementlog.tablePid);
				return;
			}

			double oldestRecord = Convert.ToDouble(data[1]);

			// This will sort data from oldest to newest.
			SortedList<double, object[]> retrievedEntries = new SortedList<double, object[]>();

			if (log.Members.Count <= 0)
			{
				protocol.Log("QA" + protocol.QActionID + "|No Items available on IML Log List.|", LogType.Error, LogLevel.NoLogging);
				return;
			}

			double initialUpdate = ParseToOADateOrDefault(log.Members.First().Created, "yyyy-MM-ddTHH:mm:ssZ", -1);

			// Items are sorted by oldest to newest.
			if (initialUpdate > oldestRecord)
			{
				CreateIntegratedManagementLogRows(protocol, log, tableSizeLimit, oldestRecord, retrievedEntries);
			}
			else
			{
				protocol.Log("QA" + protocol.QActionID + "|The Oldest recorded Time is more recent than the Initial Update Time, this is incorrect.|", LogType.Error, LogLevel.NoLogging);
			}

			if (retrievedEntries.Count > 0)
			{
				FillIntegratedManagementLogTable(protocol, tableSizeLimit, retrievedEntries);
			}
		}

		/// <summary>
		///     Suited for Network Adapters, DiskDrives, Logical Drives and Storage Enclosures.
		/// </summary>
		/// <param name="protocol">Link with Dataminer.</param>
		/// <param name="response">JSON Response.</param>
		/// <param name="trigger">HTTP Response Parameter ID.</param>
		public static void SystemsMemberIterator(SLProtocol protocol, string response, int trigger)
		{
			JsonObjects.ArrayControllersList.RootObject jsonData = serializer.Deserialize<JsonObjects.ArrayControllersList.RootObject>(response);

			if (jsonData == null)
			{
				throw new FormatException("|" + trigger + "|Received data is in an unexpected format. Response received:" + response);
			}

			if (!Iteration.ListToBufferContainsKey(trigger))
			{
				throw new ArgumentException("|" + trigger + "|The Received trigger does not have an entry in the ArrayControllerIterator Dictionary.");
			}

			if (jsonData.MembersData_count == 0 || jsonData.Members == null)
			{
				////throw new ArgumentException("|" + trigger + "|There are no Members to Iterate.");
				//// No members are returned if the Agentless Management Service (AMS) is not running on the server
				return;
			}

			List<string> keys = new List<string>();

			foreach (var item in jsonData.Members)
			{
				if (item?.Data_id == null)
				{
					continue;
				}

				string link = item.Data_id.Replace("/redfish", "redfish");
				string[] key = link.Split(new[] { '/' }, StringSplitOptions.RemoveEmptyEntries);

				if (key.Length > 0)
				{
					keys.Add(key.Last());
				}
			}

			List<string> tablekeys = new List<string>();

			int tableBufferBasedOnTrigger = Iteration.GetTableBufferBasedonTrigger(trigger);

			if (Parameter.Controller.tablePid == tableBufferBasedOnTrigger && keys.Count <= 0)
			{
				// No Controller means no Entries.
				protocol.DeleteRow(Parameter.Controller.tablePid, protocol.GetKeys(Parameter.Controller.tablePid));
				protocol.DeleteRow(Parameter.Drives.tablePid, protocol.GetKeys(Parameter.Drives.tablePid));
				protocol.DeleteRow(Parameter.Enclosure.tablePid, protocol.GetKeys(Parameter.Enclosure.tablePid));
				protocol.DeleteRow(Parameter.Logicaldrive.tablePid, protocol.GetKeys(Parameter.Logicaldrive.tablePid));
				protocol.DeleteRow(Parameter.Physicaldriver.tablePid, protocol.GetKeys(Parameter.Physicaldriver.tablePid));
				return;
			}

			// Exceptional case. Keys in the Physical Driver Table are a concatenation between <Box ID>.<Drive ID>
			// This means we need to edit the received keys in order for them to reflect the driver keys. like a conversion of sorts.
			// This is important to be executed because keys are not unique for all Boxes.
			// For instance: Box 1 has Drive 1 , 2 and 3. Box 2 has Drive 1 , 2 and 3.
			// In the table each of this drives will have PKs 1.1; 1.2; 1.3; 2.1; 2.2; 2.3
			if (Parameter.Physicaldriver.tablePid == tableBufferBasedOnTrigger)
			{
				MatchCollection matches = Regex.Matches(jsonData.Data_id, "/ArrayControllers/(.*?)/DiskDrives/");

				string boardID = String.Empty;
				if (matches.Count > 0 && matches[0].Groups.Count > 1)
				{
					boardID = matches[0].Groups[1].ToString();
				}

				if (String.IsNullOrWhiteSpace(boardID))
				{
					return;
				}

				List<string> editedKeys = new List<string>();

				for (int i = 0; i < keys.Count; i++)
				{
					editedKeys.Add(boardID + '.' + keys[i]);
				}

				// From all the Drives present only consider removing the ones in the same board.
				List<string> keysToConsider = tablekeys.Where(x => x.Contains(boardID + '.')).ToList();

				tablekeys = keysToConsider.Except(editedKeys).ToList();
			}
			else
			{
				tablekeys = protocol.GetKeys(tableBufferBasedOnTrigger).ToList();

				// Exceptional case. Native server ports are extracted from another call.
				// In order to keep both in same table it is needed to add it manually.
				// This Board "0" is always present by default in the device.
				if (Parameter.Networkadapters.tablePid == tableBufferBasedOnTrigger)
				{
					tablekeys.Remove("0");
				}

				// This case only applies when you retrieve the list and have the full scope of all the Keys expected to be present.
				tablekeys = tablekeys.Except(keys).ToList();
			}

			// This case Covers the disappearance of one row from a table (any table)
			protocol.DeleteRow(tableBufferBasedOnTrigger, tablekeys.ToArray());

			foreach (var item in tablekeys)
			{
				// In case a Controller gets missing we need to delete entries in child tables.
				if (Parameter.Controller.tablePid == tableBufferBasedOnTrigger)
				{
					if (protocol.Exists(Parameter.Drives.tablePid, "Enclosures." + item))
					{
						protocol.DeleteRow(Parameter.Drives.tablePid, item);
						string[] keysToDelete = Utils.ProtocolHelper.GetPKbyFk(
							protocol,
							Parameter.Enclosure.tablePid,
							item,
							Parameter.Enclosure.Idx.enclosureindex_2901,
							Parameter.Enclosure.Idx.enclosurefk_2904);
						protocol.DeleteRow(Parameter.Enclosure.tablePid, keysToDelete);
					}

					if (protocol.Exists(Parameter.Drives.tablePid, "Logical Drives." + item))
					{
						protocol.DeleteRow(Parameter.Drives.tablePid, item);
						string[] keysToDelete = Utils.ProtocolHelper.GetPKbyFk(
							protocol,
							Parameter.Logicaldrive.tablePid,
							item,
							Parameter.Logicaldrive.Idx.logicaldriveindex_2801,
							Parameter.Logicaldrive.Idx.logicaldrivefk_2805);
						protocol.DeleteRow(Parameter.Logicaldrive.tablePid, keysToDelete);
					}

					if (protocol.Exists(Parameter.Drives.tablePid, "Physical Drives." + item))
					{
						protocol.DeleteRow(Parameter.Drives.tablePid, item);
						string[] keysToDelete = Utils.ProtocolHelper.GetPKbyFk(
							protocol,
							Parameter.Physicaldriver.tablePid,
							item,
							Parameter.Physicaldriver.Idx.physicaldriverindex_2701,
							Parameter.Physicaldriver.Idx.physicaldriverfk_2709);
						protocol.DeleteRow(Parameter.Physicaldriver.tablePid, keysToDelete);
					}
				}

				// Same for The Network Adapters Tree Control
				if (Parameter.Networkadapters.tablePid == tableBufferBasedOnTrigger)
				{
					string[] keysToDelete = Utils.ProtocolHelper.GetPKbyFk(
						protocol,
						Parameter.Networkadaptersport.tablePid,
						item,
						Parameter.Networkadaptersport.Idx.networkadaptersportindex_2401,
						Parameter.Networkadaptersport.Idx.networkadaptersportfk_2407);
					protocol.DeleteRow(Parameter.Networkadaptersport.tablePid, keysToDelete);
				}
			}

			if (keys.Count > 0)
			{
				Iteration.SetNewBuffer(protocol, trigger, keys);
			}
		}

		public static void SystemsMemoryList(SLProtocol protocol, string response, int trigger)
		{
			List<object[]> memorySummary = new List<object[]>();
			JsonObjects.Memorys.RootObject memorys = serializer.Deserialize<JsonObjects.Memorys.RootObject>(response);

			if (memorys == null)
			{
				throw new FormatException("|Received data is in an unexpected format. Response received:" + response);
			}

			var busAddress = Utils.ProtocolHelper.GetBusAddress(protocol);

			string configuredAMPMode;
			string status;

			if (memorys.Oem?.Hpe == null)
			{
				configuredAMPMode = Constants.DefaultValue;
				status = Constants.DefaultValue;
			}
			else
			{
				configuredAMPMode = String.IsNullOrWhiteSpace(memorys.Oem.Hpe.AmpModeActive) ? Constants.DefaultValue : memorys.Oem.Hpe.AmpModeActive;
				status = String.IsNullOrWhiteSpace(memorys.Oem.Hpe.AmpModeStatus) ? Constants.DefaultValue : memorys.Oem.Hpe.AmpModeStatus;
			}

			protocol.SetParameters(new[] { Parameter.advancedmodestatus_525, Parameter.configuredampmode_526 }, new object[] { status, configuredAMPMode });

			if (memorys.Members != null)
			{
				CreateMemorySummaryRows(memorySummary, memorys);
			}

			if (memorySummary.Count > 0)
			{
				protocol.FillArray(Parameter.Memorysummary.tablePid, memorySummary, NotifyProtocol.SaveOption.Full);
			}
		}

		public static void SystemsNetworkandIloInterfaces(SLProtocol protocol, string response, string response2, string response3)
		{
			// protocol.Log("QA" + protocol.QActionID + "|SystemsNetworkandILOInterfaces|response:\n" + response, LogType.DebugInfo, LogLevel.NoLogging);
			// protocol.Log("QA" + protocol.QActionID + "|SystemsNetworkandILOInterfaces|response2:\n" + response2, LogType.DebugInfo, LogLevel.NoLogging);
			// protocol.Log("QA" + protocol.QActionID + "|SystemsNetworkandILOInterfaces|response3:\n" + response3, LogType.DebugInfo, LogLevel.NoLogging);
			response = response.Replace("\"#", "\"");
			response2 = response2.Replace("\"#", "\"");
			response3 = response3.Replace("\"#", "\"");

			JsonObjects.BaseNetworkCard.RootObject baseAdapters = serializer.Deserialize<JsonObjects.BaseNetworkCard.RootObject>(response3);
			JsonObjects.SystemsNetworkAdapters.RootObject ethernet = serializer.Deserialize<JsonObjects.SystemsNetworkAdapters.RootObject>(response);
			JsonObjects.ILOInterfaces.RootObject ilo = serializer.Deserialize<JsonObjects.ILOInterfaces.RootObject>(response2);

			Dictionary<string, object[]> adapters = new Dictionary<string, object[]>();
			Dictionary<string, object[]> interfaces = new Dictionary<string, object[]>();

			if (baseAdapters == null || (ethernet == null && ilo == null))
			{
				throw new FormatException("|Received data is in an unexpected format. Response received:" + response);
			}

			if (ilo?.Members != null && ilo.Members.Count > 0)
			{
				NetworkadaptersQActionRow adapter = new NetworkadaptersQActionRow();
				{
					adapter.Networkadaptersindex_2301 = "0";
					adapter.Networkadaptersstatusstate_2302 =
						ilo.Members[0].Status == null || String.IsNullOrWhiteSpace(ilo.Members[0].Status.State) ? Constants.DefaultValue : ilo.Members[0].Status.State;
					adapter.Networkadaptersfirmware_2303 = Constants.DefaultValue;
					adapter.Networkadaptersname_2304 = "iLo Management";
					adapter.Networkadaptersstatushealth_2305 =
						ilo.Members[0].Status == null || String.IsNullOrWhiteSpace(ilo.Members[0].Status.Health) ? Constants.DefaultValue : ilo.Members[0].Status.Health;
				}

				adapters.Add(adapter.Networkadaptersindex_2301.ToString(), adapter);

				foreach (var member in ilo.Members)
				{
					if (member == null || String.IsNullOrWhiteSpace(member.Id))
					{
						continue;
					}

					NetworkadaptersportQActionRow adapterport = new NetworkadaptersportQActionRow();
					string ipv4Temp = null;
					string ipv6Temp = null;
					string networkAdapterSportStatusState = null;
					string networkAdapterSportStatusHealth = null;

					if (member.IPv4Addresses != null)
					{
						ipv4Temp = String.Join("|", member.IPv4Addresses.Select(x => Convert.ToString(x.Address)).ToArray());
					}

					if (member.IPv6Addresses != null)
					{
						ipv6Temp = String.Join("|", member.IPv6Addresses.Select(x => Convert.ToString(x.Address)).ToArray());
					}

					if (member.Status == null)
					{
						networkAdapterSportStatusState = Constants.DefaultValue;
						networkAdapterSportStatusHealth = Constants.DefaultValue;
					}
					else
					{
						networkAdapterSportStatusState = String.IsNullOrWhiteSpace(member.Status.State) ? Constants.DefaultValue : member.Status.State;
						networkAdapterSportStatusHealth = String.IsNullOrWhiteSpace(member.Status.Health) ? Constants.DefaultValue : member.Status.Health;

						if (String.Equals(member.Status.State, "Enabled"))
						{
							protocol.SetParameters(new[] { Parameter.ipv4address_529, Parameter.ipv6address_530 }, new object[] { ipv4Temp, ipv6Temp });
						}
					}

					adapterport.Networkadaptersportindex_2401 = "iLo Management/" + member.Id;
					adapterport.Networkadaptersportmacaddress_2402 = member.MACAddress ?? Constants.DefaultValue;
					adapterport.Networkadaptersportipv4_2403 = String.IsNullOrWhiteSpace(ipv4Temp) ? Constants.DefaultValue : ipv4Temp;
					adapterport.Networkadaptersportipv6_2404 = String.IsNullOrWhiteSpace(ipv6Temp) ? Constants.DefaultValue : ipv6Temp;
					adapterport.Networkadaptersportstatusstate_2405 = networkAdapterSportStatusState;
					adapterport.Networkadaptersportteambridge_2406 = Constants.DefaultValue;
					adapterport.Networkadaptersportfk_2407 = "0";
					adapterport.Networkadaptersportnumber_2408 = member.Id;
					adapterport.Networkadaptersportstatushealth_2409 = networkAdapterSportStatusHealth;
					adapterport.Networkadaptersportwwnn_2411 = Constants.DefaultValue;
					adapterport.Networkadaptersportwwpn_2412 = Constants.DefaultValue;

					interfaces.Add(adapterport.Networkadaptersportindex_2401.ToString(), adapterport);
				}
			}

			if (baseAdapters?.Members != null)
			{
				foreach (var adapter in baseAdapters.Members)
				{
					if (adapter == null)
					{
						continue;
					}

					NetworkadaptersQActionRow baseadapter = new NetworkadaptersQActionRow();

					baseadapter.Networkadaptersindex_2301 = adapter.Id;
					baseadapter.Networkadaptersstatusstate_2302 = adapter.Status == null || String.IsNullOrWhiteSpace(adapter.Status.State) ? Constants.DefaultValue : adapter.Status.State;

					if (adapter.Firmware?.Current == null || String.IsNullOrWhiteSpace(adapter.Firmware.Current.VersionString))
					{
						baseadapter.Networkadaptersfirmware_2303 = Constants.DefaultValue;
					}
					else
					{
						baseadapter.Networkadaptersfirmware_2303 = adapter.Firmware.Current.VersionString;
					}

					baseadapter.Networkadaptersname_2304 = adapter.Name;
					baseadapter.Networkadaptersstatushealth_2305 = adapter.Status == null || String.IsNullOrWhiteSpace(adapter.Status.Health) ? Constants.DefaultValue : adapter.Status.Health;

					adapters.Add(adapter.Id, baseadapter);

					if (adapter.PhysicalPorts != null)
					{
						for (int i = 0; i < adapter.PhysicalPorts.Count; i++)
						{
							var physicalport = adapter.PhysicalPorts[i];
							if (physicalport?.Oem?.Hpe == null)
							{
								continue;
							}

							string ipv4Temp = null;
							string ipv6Temp = null;
							string networkAdapterSportTeamBridge = null;
							string networkAdapterSportStatusState = null;
							string networkAdapterSportStatusHealth = null;

							NetworkadaptersportQActionRow adapterport = new NetworkadaptersportQActionRow();

							if (physicalport.IPv4Addresses != null)
							{
								ipv4Temp = String.Join("|", physicalport.IPv4Addresses.Select(x => Convert.ToString(x.Address)).ToArray());
							}

							if (physicalport.IPv6Addresses != null)
							{
								ipv6Temp = String.Join("|", physicalport.IPv6Addresses.Select(x => Convert.ToString(x.Address)).ToArray());
							}

							// Still need to find status in other object (response instead of repsonse3)
							if (physicalport.Oem?.Hpe == null || String.IsNullOrWhiteSpace(physicalport.Oem.Hpe.Team))
							{
								networkAdapterSportTeamBridge = Constants.DefaultValue;
							}
							else
							{
								networkAdapterSportTeamBridge = physicalport.Oem.Hpe.Team;
							}

							if (physicalport.Status == null)
							{
								networkAdapterSportStatusState = Constants.DefaultValue;
								networkAdapterSportStatusHealth = Constants.DefaultValue;
							}
							else
							{
								CheckNetworkAdapterPort(ethernet, physicalport, adapterport);
							}

							adapterport.Networkadaptersportindex_2401 = "Slot - " + adapter.Id + "." + Convert.ToString(i + 1) + ".network";
							adapterport.Networkadaptersportmacaddress_2402 = String.IsNullOrWhiteSpace(physicalport.MacAddress) ? Constants.DefaultValue : physicalport.MacAddress;
							adapterport.Networkadaptersportipv4_2403 = String.IsNullOrWhiteSpace(ipv4Temp) ? Constants.DefaultValue : ipv4Temp;
							adapterport.Networkadaptersportipv6_2404 = String.IsNullOrWhiteSpace(ipv6Temp) ? Constants.DefaultValue : ipv6Temp;
							adapterport.Networkadaptersportstatusstate_2405 = networkAdapterSportStatusState;
							adapterport.Networkadaptersportteambridge_2406 = networkAdapterSportTeamBridge;
							adapterport.Networkadaptersportfk_2407 = adapter.Id;
							adapterport.Networkadaptersportnumber_2408 = i + 1 + " (Network)";
							adapterport.Networkadaptersportstatushealth_2409 = networkAdapterSportStatusHealth;
							adapterport.Networkadaptersportwwnn_2411 = Constants.DefaultValue;
							adapterport.Networkadaptersportwwpn_2412 = Constants.DefaultValue;

							interfaces.Add(adapterport.Networkadaptersportindex_2401.ToString(), adapterport);
						}
					}

					if (adapter.FcPorts != null)
					{
						for (int i = 0; i < adapter.FcPorts.Count; i++)
						{
							var fcPort = adapter.FcPorts[i];

							if (fcPort == null)
							{
								continue;
							}

							NetworkadaptersportQActionRow adapterport = new NetworkadaptersportQActionRow();
							adapterport.Networkadaptersportindex_2401 = "Slot - " + adapter.Id + "." + Convert.ToString(i + 1) + ".fcoe";
							adapterport.Networkadaptersportmacaddress_2402 = Constants.DefaultValue;
							adapterport.Networkadaptersportipv4_2403 = Constants.DefaultValue;
							adapterport.Networkadaptersportipv6_2404 = Constants.DefaultValue;

							// Still need to find status in other object (response instead of repsonse3)
							adapterport.Networkadaptersportstatusstate_2405 = adapter.Status == null || String.IsNullOrWhiteSpace(adapter.Status.State) ? Constants.DefaultValue : adapter.Status.State;
							adapterport.Networkadaptersportteambridge_2406 = Constants.DefaultValue;
							adapterport.Networkadaptersportfk_2407 = adapter.Id;
							adapterport.Networkadaptersportnumber_2408 = i + 1 + " (FCoE)";
							adapterport.Networkadaptersportstatushealth_2409 =
								adapter.Status == null || String.IsNullOrWhiteSpace(adapter.Status.Health) ? Constants.DefaultValue : adapter.Status.Health;
							adapterport.Networkadaptersportwwnn_2411 = fcPort.WWNN;
							adapterport.Networkadaptersportwwpn_2412 = fcPort.WWPN;

							interfaces.Add(adapterport.Networkadaptersportindex_2401.ToString(), adapterport);
						}
					}
				}
			}

			if (adapters.Count > 0)
			{
				protocol.FillArray(Parameter.Networkadapters.tablePid, adapters.Values.ToList(), NotifyProtocol.SaveOption.Full);
			}

			if (interfaces.Count > 0)
			{
				protocol.FillArray(Parameter.Networkadaptersport.tablePid, interfaces.Values.ToList(), NotifyProtocol.SaveOption.Full);
			}
		}

