		public static void SystemsSingleSmartStorageArrayController(SLProtocol protocol, string response)
		{
			JsonObjects.ArrayController.RootObject jsonData = serializer.Deserialize<JsonObjects.ArrayController.RootObject>(response);

			if (jsonData?.Id == null)
			{
				throw new FormatException("|Received data is in an unexpected format. Response received:" + response);
			}

			CreateControllerRow(protocol, jsonData);

			// Start Looping through Logical Drives, Enclosures and Disk Drives (aka Physical Drives)
			Dictionary<int, object> dataToSet = new Dictionary<int, object>();

			bool nullLinks = jsonData.Links == null;
			if (nullLinks || jsonData.Links.LogicalDrives?.Data_id == null)
			{
				dataToSet.Add(Parameter.urigetsystemssmartstoragearraycontrollerslogicaldriverslist_1033, Constants.DefaultValue);
			}
			else
			{
				dataToSet.Add(Parameter.urigetsystemssmartstoragearraycontrollerslogicaldriverslist_1033, jsonData.Links.LogicalDrives.Data_id.Replace("/redfish", "redfish"));
			}

			if (nullLinks || jsonData.Links.PhysicalDrives?.Data_id == null)
			{
				dataToSet.Add(Parameter.urigetsystemssmartstoragearraycontrollersdiskdriveslist_1035, Constants.DefaultValue);
			}
			else
			{
				dataToSet.Add(Parameter.urigetsystemssmartstoragearraycontrollersdiskdriveslist_1035, jsonData.Links.PhysicalDrives.Data_id.Replace("/redfish", "redfish"));
			}

			if (nullLinks || jsonData.Links.StorageEnclosures?.Data_id == null)
			{
				dataToSet.Add(Parameter.urigetsystemssmartstoragearraycontrollersstorageenclosureslist_1037, Constants.DefaultValue);
			}
			else
			{
				dataToSet.Add(Parameter.urigetsystemssmartstoragearraycontrollersstorageenclosureslist_1037, jsonData.Links.StorageEnclosures.Data_id.Replace("/redfish", "redfish"));
			}

			protocol.SetParameters(dataToSet.Keys.ToArray(), dataToSet.Values.ToArray());

			foreach (var item in dataToSet)
			{
				protocol.CheckTrigger(item.Key);
			}
		}

