		public static void SystemsStorage(SLProtocol protocol, string response)
		{
			JsonObjects.Storage.RootObject jsonData = JsonConvert.DeserializeObject<JsonObjects.Storage.RootObject>(response);
			if (jsonData?.Id == null)
			{
				throw new FormatException("Received data is in an unexpected format. Response received:" + response);
			}

			// Add row to the storage table
			var row = new StoragetableQActionRow
			{
				Storageindex_4301 = jsonData.Id,
				Storagename_4302 = jsonData.Name,
				Storagehealth_4303 = jsonData.Status?.Health ?? "-1",
				Storagestate_4304 = jsonData.Status?.State ?? "-1",
				Storagedrives_4305 = jsonData.Drives.Count,
			};

			var storageTable = new QActionTable(protocol, Parameter.Storagetable.tablePid, "Storage Table");
			storageTable.SetRow(row, true);

			// Add controllers to storage controller table
			if (jsonData.StorageControllers != null)
			{
				var storageControllerTable = new QActionTable(protocol, Parameter.Storagecontrollerstable.tablePid, "Storage Controllers Table");
				foreach (var controller in jsonData.StorageControllers)
				{
					var storageRow = new StoragecontrollerstableQActionRow
					{
						Storagecontrollersindex_4401 = $"{jsonData.Id}/{controller.MemberId}",
						Storagecontrollersname_4402 = controller.Name,
						Storagecontrollersmodel_4403 = controller.Model,
						Storagecontrollershealth_4404 = controller.Status?.Health ?? "-1",
						Storagecontrollersstate_4405 = controller.Status?.State ?? "-1",
						Storagecontrollersfirmware_4406 = controller.FirmwareVersion ?? "-1",
						Storagecontrollerslocation_4407 = controller.Location?.PartLocation?.ServiceLabel ?? "-1",
						Storagecontrollersserialnumber_4408 = controller.SerialNumber,
						Storagecontrollerssupporteddeviceprotocols_4409 = controller.SupportedDeviceProtocols != null ? String.Join(", ", controller.SupportedDeviceProtocols) : "-1",
						Storagecontrollersfk_4410 = jsonData.Id,
					};
					storageControllerTable.SetRow(storageRow, true);
				}
			}

			// Trigger polling for each drive found in the json body
			foreach (var member in jsonData.Drives)
			{
				protocol.SetParameter(Parameter.urigetstoragedrives_1047, member.OdataId.Replace("/redfish", "redfish"));
				protocol.CheckTrigger(Parameter.urigetstoragedrives_1047);
			}
		}

		public static void SystemsStorageCollection(SLProtocol protocol, string response)
		{
			JsonObjects.StorageCollection.RootObject jsonData = JsonConvert.DeserializeObject<JsonObjects.StorageCollection.RootObject>(response);
			if (jsonData?.Members == null)
			{
				throw new FormatException("Received data is in an unexpected format. Response received:" + response);
			}

			// Clear related tables if no storage is present
			if (jsonData.Members.Count < 1)
			{
				protocol.ClearAllKeys(Parameter.Storagetable.tablePid);
				protocol.ClearAllKeys(Parameter.Storagecontrollerstable.tablePid);
				protocol.ClearAllKeys(Parameter.Storagedrivestable.tablePid);
				return;
			}

			// cleanup old rows if data members don't exist anymore (drive was removed or swapped)
			List<string> newKeys = jsonData.Members.Select(x => x.OdataId.TrimEnd('/').Split('/').Last()).ToList();
			string[] storageKeys = protocol.GetKeys(Parameter.Storagetable.tablePid);
			string[] storageDrivesKeys = protocol.GetKeys(Parameter.Storagedrivestable.tablePid);
			string[] storageControllerKeys = protocol.GetKeys(Parameter.Storagecontrollerstable.tablePid);

			string[] oldStorageKeys = storageKeys.Where(x => !newKeys.Contains(x)).ToArray();
			if (oldStorageKeys.Any())
			{
				protocol.DeleteRow(Parameter.Storagetable.tablePid, oldStorageKeys);
			}

			string[] oldControllerKeys = storageControllerKeys.Where(x => !newKeys.Contains(x.Split('/')[0])).ToArray();
			if (oldControllerKeys.Any())
			{
				protocol.DeleteRow(Parameter.Storagecontrollerstable.tablePid, oldControllerKeys);
			}

			string[] oldStorageDriveKeys = storageDrivesKeys.Where(x => !newKeys.Contains(x.Split('/')[0])).ToArray();
			if (oldStorageDriveKeys.Any())
			{
				protocol.DeleteRow(Parameter.Storagedrivestable.tablePid, oldStorageDriveKeys);
			}

			// Trigger polling for each data member found in the json body
			foreach (var member in jsonData.Members)
			{
				protocol.SetParameter(Parameter.urigetstorage_1046, member.OdataId.Replace("/redfish", "redfish"));
				protocol.CheckTrigger(Parameter.urigetstorage_1046);
			}
		}

		public static void SystemsStorageDrive(SLProtocol protocol, string response)
		{
			JsonObjects.StorageDrive.RootObject jsonData = JsonConvert.DeserializeObject<JsonObjects.StorageDrive.RootObject>(response);
			if (jsonData?.Id == null)
			{
				throw new FormatException("Received data is in an unexpected format. Response received:" + response);
			}

			// Add row to the storage drive table
			string storageId = new Regex("Storage/.*?/").Match(jsonData.OdataId).Value.Trim('/').Split('/').Last();
			string rowKey = $"{storageId}/{jsonData.Id}";
			var row = new StoragedrivestableQActionRow
			{
				Storagedrivesindex_4501 = rowKey,
				Storagedrivesname_4502 = jsonData.Name,
				Storagedrivesmodel_4503 = jsonData.Model,
				Storagedrivesmediatype_4504 = jsonData.MediaType,
				Storagedriveshealth_4505 = jsonData.Status?.Health ?? "-1",
				Storagedrivescapacity_4506 = jsonData.CapacityBytes / 1000000000.0, // bytes to Gigabytes
				Storagedrivesserialnumber_4507 = jsonData.SerialNumber,
				Storagedrivesrevision_4508 = jsonData.Revision,
				Storagedrivesfk_4509 = storageId,
			};

			var storageDriveTable = new QActionTable(protocol, Parameter.Storagedrivestable.tablePid, "Storage Drive Table");
			storageDriveTable.SetRow(row, true);
		}

		internal static double ParseToOADateOrDefault(object o, string format, double @default)
		{
			DateTime dateTime;

			if (DateTime.TryParseExact(o.ToString(), format, CultureInfo.InvariantCulture, DateTimeStyles.AdjustToUniversal, out dateTime))
			{
				return dateTime.ToOADate();
			}

			return @default;
		}

		private static void BuildSmartStorageBatteryRow(List<object[]> smartBatteries, JsonObjects.Chassis.SmartStorageBattery battery)
		{
			SmartstoragebatteryQActionRow row = new SmartstoragebatteryQActionRow
			{
				Smartstoragebatteryindex_2501 = Convert.ToString(battery.Index),
				Smartstoragebatterypresent_2502 = Constants.DefaultValue,
				Smartstoragebatterycondition_2503 = Constants.DefaultValue,
			};

			if (battery.Status != null)
			{
				row.Smartstoragebatterypresent_2502 = String.IsNullOrWhiteSpace(battery.Status.State) ? Constants.DefaultValue : battery.Status.State;

				if (String.IsNullOrWhiteSpace(battery.Status.Health))
				{
					row.Smartstoragebatterycondition_2503 = Constants.DefaultValue;
				}
				else if (battery.Status.Health == "OK")
				{
					row.Smartstoragebatterycondition_2503 = "PS_OK";
				}
				else
				{
					row.Smartstoragebatterycondition_2503 = battery.Status.Health;
				}
			}

			row.Smartstoragebatterymodel_2504 = GetValueOrDefault(battery.Model);
			row.Smartstoragebatteryspare_2505 = GetValueOrDefault(battery.SparePartNumber);
			row.Smartstoragebatteryserial_2506 = GetValueOrDefault(battery.SerialNumber);
			row.Smartstoragebatterymaxcapwatts_2507 = battery.MaximumCapWatts ?? -1;
			row.Smartstoragebatteryfirmwareversion_2508 = GetValueOrDefault(battery.FirmwareVersion);
			row.Smartstoragebatteryproductname_2509 = battery.ProductName;
			smartBatteries.Add(row);
		}

		private static void CheckIfNeedToEmptyCount(SortedList<int?, IloeventlogQActionRow> retrievedEntries, bool firstPoll, KeyValuePair<int, object[]> item)
		{
			if (retrievedEntries.Any(x => Convert.ToString(x.Value.Iloeventlogdescription_2206) == Convert.ToString(item.Value[Parameter.Iloeventlog.Idx.iloeventlogdescription_2206])) && firstPoll)
			{
				item.Value[Parameter.Iloeventlog.Idx.iloeventlogcount_2205] = 0;
			}
		}

		private static void CheckNetworkAdapterPort(
			JsonObjects.SystemsNetworkAdapters.RootObject ethernet,
			JsonObjects.BaseNetworkCard.PhysicalPort physicalport,
			NetworkadaptersportQActionRow adapterport)
		{
			// Find MAC Address to match Status from other tree.
			adapterport.Networkadaptersportstatusstate_2405 = String.IsNullOrWhiteSpace(physicalport.LinkStatus) ? Constants.DefaultValue : physicalport.LinkStatus;
			adapterport.Networkadaptersportstatushealth_2409 = String.IsNullOrWhiteSpace(physicalport.Status.Health) ? Constants.DefaultValue : physicalport.Status.Health;

			if (ethernet.Members == null)
			{
				return;
			}

			foreach (var networkadapter in ethernet.Members)
			{
				if (networkadapter == null)
				{
					continue;
				}

				if (String.Equals(networkadapter.MACAddress, physicalport.MacAddress, StringComparison.OrdinalIgnoreCase))
				{
					adapterport.Networkadaptersportstatusstate_2405 = String.IsNullOrWhiteSpace(networkadapter.Status.State) ? Constants.DefaultValue : networkadapter.Status.State;
					adapterport.Networkadaptersportstatushealth_2409 = String.IsNullOrWhiteSpace(networkadapter.Status.Health) ? Constants.DefaultValue : networkadapter.Status.Health;
					break;
				}
			}
		}

