		private static void CreateEnclosureRow(SLProtocol protocol, JsonObjects.StorageEnclosure.RootObject enclosure, string drivekey)
		{
			EnclosureQActionRow row = new EnclosureQActionRow();

			row.Enclosureindex_2901 = enclosure.Id;

			if (enclosure.Status == null)
			{
				row.Enclosurestatusstate_2902 = Constants.DefaultValue;
				row.Enclosurestatushealth_2906 = Constants.DefaultValue;
			}
			else
			{
				row.Enclosurestatusstate_2902 = String.IsNullOrWhiteSpace(enclosure.Status.State) ? Constants.DefaultValue : enclosure.Status.State;
				row.Enclosurestatushealth_2906 = String.IsNullOrWhiteSpace(enclosure.Status.Health) ? Constants.DefaultValue : enclosure.Status.Health;
			}

			row.Enclosureports_2903 = enclosure.DriveBayCount ?? -1;
			row.Enclosurefk_2904 = drivekey;
			row.Enclosurename_2905 = enclosure.Name + '/' + enclosure.Id;

			if (enclosure.Location == null)
			{
				row.Enclosurecontroller_2907 = Constants.DefaultValue;
				row.Enclosurebox_2908 = Constants.DefaultValue;
			}
			else
			{
				string[] location = enclosure.Location.Split(':');

				// "Location": "1I:1",
				if (location.Length == 2)
				{
					row.Enclosurecontroller_2907 = location[0];
					row.Enclosurebox_2908 = location[1];
				}
				else
				{
					protocol.Log("QA" + protocol.QActionID + "|Unexpected Location Format" + enclosure.Location, LogType.Error, LogLevel.NoLogging);
					row.Enclosurecontroller_2907 = Constants.DefaultValue;
					row.Enclosurebox_2908 = Constants.DefaultValue;
				}
			}

			if (protocol.Exists(Parameter.Enclosure.tablePid, row.Key))
			{
				protocol.SetRow(Parameter.Enclosure.tablePid, row.Key, row.ToObjectArray());
			}
			else
			{
				protocol.AddRow(Parameter.Enclosure.tablePid, row.ToObjectArray());
			}
		}

