		private static void CreateIloEventLogRows(
			JsonObjects.EventLog.RootObject iloEventResponse,
			double tableSizeLimit,
			SortedList<int?, IloeventlogQActionRow> retrievedEntries,
			bool excludeLoginMessages)
		{
			foreach (var iloEvent in iloEventResponse.Events)
			{
				if (iloEvent?.Description == null)
				{
					continue;
				}

				if (ExcludeLoginMessage(excludeLoginMessages, iloEvent.Description))
				{
					continue;
				}

				double initialUpdate = ParseToOADateOrDefault(iloEvent.Initial_update, "MM/dd/yyyy HH:mm:ss", -1);
				double lastUpdate = ParseToOADateOrDefault(iloEvent.Last_update, "MM/dd/yyyy HH:mm:ss", -1);

				IloeventlogQActionRow row = new IloeventlogQActionRow
				{
					Iloeventlogindex_2201 = iloEvent.Id,
					Iloeventlogseverity_2202 = String.IsNullOrWhiteSpace(iloEvent.Severity) ? Constants.DefaultValue : iloEvent.Severity,
					Iloeventloglastupdate_2203 = lastUpdate,
					Iloeventloginitialupdate_2204 = initialUpdate,
					Iloeventlogcount_2205 = iloEvent.Count,
					Iloeventlogdescription_2206 = String.IsNullOrWhiteSpace(iloEvent.Description) ? Constants.DefaultValue : iloEvent.Description,
				};

				retrievedEntries.Add(iloEvent.Id, row);

				if (retrievedEntries.Count > tableSizeLimit)
				{
					retrievedEntries.RemoveAt(0); // First item added is always the oldest according to the device output.
				}
			}
		}

		private static void CreateIntegratedManagementLogRows(
			SLProtocol protocol,
			JsonObjects.LogServicesImlLog.RootObject log,
			double tablesizelimit,
			double oldestRecord,
			SortedList<double, object[]> retrievedEntries)
		{
			foreach (var member in log.Members)
			{
				if (member?.Id == null || member.Created == null || member.Oem.Hpe.Updated == null)
				{
					protocol.Log("QA" + protocol.QActionID + "|The Systems Log Service contains an empty Members branch.|", LogType.Error, LogLevel.NoLogging);
					continue;
				}

				double initialUpdate = ParseToOADateOrDefault(member.Created, "yyyy-MM-ddTHH:mm:ssZ", -1);

				double lastUpdate;
				if (member.Oem?.Hpe?.Updated == null)
				{
					lastUpdate = -1;
				}
				else
				{
					lastUpdate = ParseToOADateOrDefault(member.Oem.Hpe.Updated, "yyyy-MM-ddTHH:mm:ssZ", -1);
				}

				if (oldestRecord > initialUpdate)
				{
					protocol.Log("QA" + protocol.QActionID + "|The Oldest recorded Time is more recent than the Initial Update Time, this is incorrect.|", LogType.Error, LogLevel.NoLogging);
					continue;
				}

				IntegratedmanagementlogQActionRow row = new IntegratedmanagementlogQActionRow
				{
					Integratedmanagementlogindex_2101 = Convert.ToDouble(member.Id),
					Integratedmanagementlogseverity_2102 = GetValueOrDefault(member.Severity),
					Integratedmanagementloglastupdate_2103 = lastUpdate,
					Integratedmanagementloginitialupdate_2104 = initialUpdate,
					Integratedmanagementlogdescription_2105 = GetValueOrDefault(member.Message),
				};

				retrievedEntries.Add(Convert.ToDouble(member.Id), row);

				if (retrievedEntries.Count > tablesizelimit)
				{
					retrievedEntries.RemoveAt(0); // First item added is always the oldest according to the device output.
				}
			}
		}

