		private static void CreatePhysicalDriverRow(SLProtocol protocol, JsonObjects.DiskDrive.RootObject diskDrive, string parentController, string drivekey)
		{
			PhysicaldriverQActionRow row = new PhysicaldriverQActionRow
			{
				Physicaldriverindex_2701 = parentController + '.' + diskDrive.Id,
				Physicaldriverstatusstate_2702 = GetValueOrDefault(diskDrive.Status?.State),
				Physicaldriverstatushealth_2710 = GetValueOrDefault(diskDrive.Status?.Health),
				Physicaldrivermodel_2703 = String.IsNullOrWhiteSpace(diskDrive.Model) ? Constants.DefaultValue : diskDrive.Model,
				Physicaldrivercapacity_2704 = diskDrive.CapacityGB ?? -1,
				Physicaldriverfirmwareversion_2705 = GetValueOrDefault(diskDrive.FirmwareVersion?.Current?.VersionString),
				Physicaldriverdrivetype_2706 = GetValueOrDefault(diskDrive.InterfaceType),
				Physicaldriverencryptionstate_2707 = diskDrive.EncryptedDrive ? 1 : 0,
				Physicaldriverdrivemediatype_2708 = GetValueOrDefault(diskDrive.MediaType),
				Physicaldriverfk_2709 = drivekey,
				Physicaldriverserialnumber_2711 = GetValueOrDefault(diskDrive.SerialNumber),
			};

			if (diskDrive.Location == null)
			{
				row.Physicaldrivercontrollerbox_2712 = Constants.DefaultValue;
				row.Physicaldriverbox_2714 = Constants.DefaultValue;
				row.Physicaldriverbay_2713 = Constants.DefaultValue;
			}
			else
			{
				string[] location = diskDrive.Location.Split(':'); // "Location": "2I:1:6"
				if (location.Length == 3)
				{
					row.Physicaldrivercontrollerbox_2712 = location[0];
					row.Physicaldriverbox_2714 = location[1];
					row.Physicaldriverbay_2713 = location[2];
				}
			}

			if (protocol.Exists(Parameter.Physicaldriver.tablePid, row.Key))
			{
				protocol.SetRow(Parameter.Physicaldriver.tablePid, row.Key, row.ToObjectArray());
			}
			else
			{
				protocol.AddRow(Parameter.Physicaldriver.tablePid, row.ToObjectArray());
			}
		}

		private static void CreatePowerSupplyRows(JsonObjects.Chassis.RootObject jsonData, List<object[]> powerSupplies)
		{
			foreach (var powerSupply in jsonData.Power.PowerSupplies)
			{
				if (powerSupply?.Oem?.Hpe == null)
				{
					continue;
				}

				bool nullStatus = powerSupply.Status == null;
				PowersuppliesQActionRow row = new PowersuppliesQActionRow
				{
					Powersuppliesbay_3301 = powerSupply.Oem.Hpe.BayNumber.HasValue ? powerSupply.Oem.Hpe.BayNumber.ToString() : "N/A",
					Powersuppliesstatushealth_3302 = GetValueOrDefault(powerSupply.Status?.Health),
					Powersuppliesstatusstate_3303 = GetValueOrDefault(powerSupply.Status?.State),
					Powersupplieshotplug_3304 = Convert.ToInt32(powerSupply.Oem.Hpe.HotplugCapable),
					Powersuppliesmodel_3305 = GetValueOrDefault(powerSupply.Model),
					Powersuppliesspare_3306 = GetValueOrDefault(powerSupply.SparePartNumber),
					Powersuppliescapacity_3307 = nullStatus || (powerSupply.PowerCapacityWatts == 0 && powerSupply.Status?.State == "Absent") ? -1 : powerSupply.PowerCapacityWatts,
					Powersuppliesfirmware_3308 = GetValueOrDefault(powerSupply.FirmwareVersion),
					Powersuppliesname_3309 = powerSupply.Name,
					Powersuppliesserialnumber_3310 = GetValueOrDefault(powerSupply.SerialNumber),
				};
				powerSupplies.Add(row);
			}
		}

		private static string GetValueOrDefault(string value)
		{
			return String.IsNullOrWhiteSpace(value) ? Constants.DefaultValue : value;
		}

		private static void CreateProcessorRows(SLProtocol protocol, List<object[]> processorSummary, JsonObjects.Processors.RootObject processors)
		{
			foreach (var processor in processors.Members)
			{
				if (processor == null || String.IsNullOrWhiteSpace(processor.Id))
				{
					continue;
				}

				ProcessorsQActionRow row = new ProcessorsQActionRow();
				row.Processorsindex_3501 = processor.Id;
				row.Processorsname_3502 = processor.Name;
				row.Processorsstatushealth_3503 = processor.Status == null ? Constants.DefaultValue : processor.Status.Health;
				row.Processorsinstructionset_3505 = processor.InstructionSet;
				row.Processorsmanufacturer_3506 = processor.Manufacturer;
				if (processor.Oem?.Hpe == null)
				{
					row.Processorsspeed_3504 = -1;
				}
				else
				{
					row.Processorsspeed_3504 = processor.Oem.Hpe.RatedSpeedMHz;

					if (processor.Oem.Hpe.Cache != null)
					{
						FillCacheRowProperties(protocol, processor, row);
					}
				}

				processorSummary.Add(row);
			}
		}

