		private static bool ExcludeLoginMessage(bool excludeLoginMessages, string description)
		{
			return excludeLoginMessages && (description.Contains("Browser login:") || description.Contains("Browser logout:"));
		}

		private static void FillCacheRowProperties(SLProtocol protocol, JsonObjects.Processors.Member processor, ProcessorsQActionRow row)
		{
			foreach (var cacheobject in processor.Oem.Hpe.Cache)
			{
				if (cacheobject == null)
				{
					continue;
				}

				switch (cacheobject.Name)
				{
					case "L1-Cache":
						row.Processorsinternall1cache_3507 = cacheobject.InstalledSizeKB;
						break;

					case "L2-Cache":
						row.Processorsinternall2cache_3508 = cacheobject.InstalledSizeKB;
						break;

					case "L3-Cache":
						row.Processorsinternall3cache_3509 = cacheobject.InstalledSizeKB;
						break;

					default:
						protocol.Log("QA" + protocol.QActionID + "|SystemsProcessorList|Unexpected cache object name: " + cacheobject.Name, LogType.Error, LogLevel.NoLogging);
						break;
				}
			}
		}

		private static void FillIloEventLogTable(SLProtocol protocol, double tableSizeLimit, SortedList<int?, IloeventlogQActionRow> retrievedEntries, bool excludeLoginMessages)
		{
			int tableSize = protocol.RowCount(Parameter.Iloeventlog.tablePid);

			if (tableSize == 0 && retrievedEntries.Count <= tableSizeLimit)
			{
				// groups together alarms based on the descriptions and severities in order to prevent the same alarm to come up constantly.
				// Also makes sure the initial update is the smallest value, the last update is the largest value, and the count is a sum of all of the matching alarm's counts
				var condensedList = retrievedEntries.GroupBy(item => new { item.Value.Iloeventlogdescription_2206, item.Value.Iloeventlogseverity_2202 })
					.Select(
						group => new IloeventlogQActionRow
						{
							Iloeventlogindex_2201 = group.Select(item => Convert.ToInt32(item.Value.Iloeventlogindex_2201)).Min(),
							Iloeventlogseverity_2202 = group.Select(item => Convert.ToString(item.Value.Iloeventlogseverity_2202)).First(),
							Iloeventlogdescription_2206 = group.Select(item => item.Value.Iloeventlogdescription_2206).First(),
							Iloeventlogcount_2205 = group.Sum(item => Convert.ToInt32(item.Value.Iloeventlogcount_2205)),
							Iloeventloginitialupdate_2204 = group.Min(item => item.Value.Iloeventloginitialupdate_2204),
							Iloeventloglastupdate_2203 = group.Max(item => item.Value.Iloeventloglastupdate_2203),
						}.ToObjectArray())
					.ToList();
				protocol.FillArray(Parameter.Iloeventlog.tablePid, condensedList.ToList(), NotifyProtocol.SaveOption.Full);
			}
			else
			{
				SortedList<int, object[]> currentEvents = GetEventLogTableSortedList(protocol);
				bool firstPoll = Convert.ToString(protocol.GetParameter(Parameter.urigetiloeventlogjsonapi_1041)).Contains("/0");
				foreach (var item in currentEvents)
				{
					if (item.Value.Length >= Parameter.Iloeventlog.Idx.iloeventlogdescription_2206
						&& ExcludeLoginMessage(excludeLoginMessages, Convert.ToString(item.Value[Parameter.Iloeventlog.Idx.iloeventlogdescription_2206])))
					{
						continue;
					}

					if (!retrievedEntries.ContainsKey(item.Key))
					{
						CheckIfNeedToEmptyCount(retrievedEntries, firstPoll, item);

						retrievedEntries.Add(item.Key, item.Value);
					}
				}

				// groups together alarms based on the descriptions and severities in order to prevent the same alarm to come up constantly.
				// Also makes sure the initial update is the smallest value, the last update is the largest value, and the count is a sum of all of the matching alarm's counts
				var condensedList = retrievedEntries.GroupBy(item => new { item.Value.Iloeventlogdescription_2206, item.Value.Iloeventlogseverity_2202 })
					.Select(
						group => new IloeventlogQActionRow
						{
							Iloeventlogindex_2201 = group.Select(item => Convert.ToInt32(item.Value.Iloeventlogindex_2201)).Min(),
							Iloeventlogseverity_2202 = group.Select(item => Convert.ToString(item.Value.Iloeventlogseverity_2202)).First(),
							Iloeventlogdescription_2206 = group.Select(item => item.Value.Iloeventlogdescription_2206).First(),
							Iloeventlogcount_2205 = group.Sum(item => Convert.ToInt32(item.Value.Iloeventlogcount_2205)),
							Iloeventloginitialupdate_2204 = group.Min(item => item.Value.Iloeventloginitialupdate_2204),
							Iloeventloglastupdate_2203 = group.Max(item => item.Value.Iloeventloglastupdate_2203),
						}.ToObjectArray())
					.ToDictionary(item => (int?)item[0], item => item);

				double entriesToDelete = condensedList.Count - tableSizeLimit;
				while (entriesToDelete > 0)
				{
					condensedList.Remove(condensedList.First().Key);
					entriesToDelete--;
				}

				protocol.FillArray(Parameter.Iloeventlog.tablePid, condensedList.Values.ToList(), NotifyProtocol.SaveOption.Full);
			}
		}

		private static void FillIntegratedManagementLogTable(SLProtocol protocol, double tablesizelimit, SortedList<double, object[]> retrievedEntries)
		{
			int tablesize = protocol.RowCount(Parameter.Integratedmanagementlog.tablePid);
			if (tablesize == 0 && tablesize + retrievedEntries.Count <= tablesizelimit)
			{
				protocol.FillArray(Parameter.Integratedmanagementlog.tablePid, retrievedEntries.Values.ToList(), NotifyProtocol.SaveOption.Full);
			}
			else if (tablesize + retrievedEntries.Count <= tablesizelimit)
			{
				protocol.FillArray(Parameter.Integratedmanagementlog.tablePid, retrievedEntries.Values.ToList(), NotifyProtocol.SaveOption.Partial);
			}
			else
			{
				SortedList<double, object[]> currentEvents = GetImlTableSortedList(protocol);
				foreach (var item in currentEvents)
				{
					if (!retrievedEntries.ContainsKey(item.Key))
					{
						retrievedEntries.Add(item.Key, item.Value);
					}
				}

				double entriesToDelete = retrievedEntries.Count - tablesizelimit;
				while (entriesToDelete > 0)
				{
					retrievedEntries.Remove(retrievedEntries.First().Key);
					entriesToDelete--;
				}

				protocol.FillArray(Parameter.Integratedmanagementlog.tablePid, retrievedEntries.Values.ToList(), NotifyProtocol.SaveOption.Full);
			}
		}

