			object[] tableData = (object[])protocol.NotifyProtocol(321, Parameter.Iloeventlog.tablePid, iloeventlogindexs);

			SortedList<int, object[]> currentTable = new SortedList<int, object[]>();
			object[] index = (object[])tableData[Parameter.Iloeventlog.Idx.iloeventlogindex_2201];
			object[] severity = (object[])tableData[Parameter.Iloeventlog.Idx.iloeventlogseverity_2202];
			object[] lastUpdate = (object[])tableData[Parameter.Iloeventlog.Idx.iloeventloglastupdate_2203];
			object[] initialUpdate = (object[])tableData[Parameter.Iloeventlog.Idx.iloeventloginitialupdate_2204];
			object[] count = (object[])tableData[Parameter.Iloeventlog.Idx.iloeventlogcount_2205];
			object[] description = (object[])tableData[Parameter.Iloeventlog.Idx.iloeventlogdescription_2206];

			for (int i = 0; i < index.Length; i++)
			{
				IloeventlogQActionRow row = new IloeventlogQActionRow
				{
					Iloeventlogindex_2201 = Convert.ToDouble(index[i]),
					Iloeventlogseverity_2202 = severity[i],
					Iloeventloglastupdate_2203 = lastUpdate[i],
					Iloeventloginitialupdate_2204 = initialUpdate[i],
					Iloeventlogcount_2205 = count[i],
					Iloeventlogdescription_2206 = description[i],
				};

				currentTable.Add(Convert.ToInt32(index[i]), row);
			}

			return currentTable;
		}

