namespace Utils
{
	using System;
	using System.Collections.Generic;
	using System.Linq;
	using Skyline.DataMiner.Scripting;

	public static class ProtocolHelper
	{
		private const string INDENT_STRING = "    ";

		public static string FormatJson(string json)
		{
			int indentation = 0;
			int quoteCount = 0;
			var result =
				from ch in json
				let quotes = ch == '"' ? quoteCount++ : quoteCount
				let lineBreak = ch == ',' && quotes % 2 == 0 ? ch + Environment.NewLine + String.Concat(Enumerable.Repeat(INDENT_STRING, indentation)) : null
				let openChar = ch == '{' || ch == '[' ? ch + Environment.NewLine + String.Concat(Enumerable.Repeat(INDENT_STRING, ++indentation)) : ch.ToString()
				let closeChar = ch == '}' || ch == ']' ? Environment.NewLine + String.Concat(Enumerable.Repeat(INDENT_STRING, --indentation)) + ch : ch.ToString()
				select lineBreak == null
					? openChar.Length > 1
						? openChar
						: closeChar
					: lineBreak;

			return String.Concat(result);
		}

		public static string GetBusAddress(SLProtocol protocol)
		{
			var busAddress = Convert.ToInt16(Convert.ToString(protocol.GetParameter(6 /*BusAddress*/)));

			if (busAddress < 1)
			{
				//// bypassProxy

				busAddress = 1;
			}

			return Convert.ToString(busAddress);
		}

		public static string[] GetPKbyFk(SLProtocol protocol, int tablePID, string fk, uint primarykeyIDX, uint foreignKeyIDX)
		{
			object[] data = (object[])protocol.NotifyProtocol(321, tablePID, new[] { primarykeyIDX, foreignKeyIDX });
			string[] pks = Array.ConvertAll((object[])data[0], x => Convert.ToString(x));
			string[] fks = Array.ConvertAll((object[])data[1], x => Convert.ToString(x));

			List<string> keysByFK = new List<string>();
			for (int i = 0; i < pks.Length; i++)
			{
				if (fks[i] == fk)
				{
					keysByFK.Add(pks[i]);
				}
			}

			return keysByFK.ToArray();
		}
	}
}
