//---------------------------------
// SystemMember\SystemMemberParser.cs
//---------------------------------
namespace HPILOGen10.SystemMember
{
	using System;
	using System.Collections.Generic;
	using System.Linq;
	using Newtonsoft.Json;
	using Skyline.DataMiner.Scripting;
	using static HPILOGen10.Parser;

	public class SystemMemberParser
	{
		private readonly SLProtocol protocol;
		private Dictionary<int, object> dataToSet = new Dictionary<int, object>();

		public SystemMemberParser(SLProtocol protocol)
		{
			this.protocol = protocol;
		}

		public void Parse(string response)
		{
			JsonObjects.SystemMember.RootObject systemMember = JsonConvert.DeserializeObject<JsonObjects.SystemMember.RootObject>(response);

			////protocol.Log("QA" + protocol.QActionID + "|SystemMember|Message\n" + Utils.ProtocolHelper.FormatJson(response), LogType.DebugInfo, LogLevel.NoLogging);

			if (systemMember == null)
			{
				throw new FormatException("|Received data is in an unexpected format. Response received:" + response);
			}

			dataToSet = new Dictionary<int, object>
			{
				{ Parameter.serverserialnumber_501, String.IsNullOrWhiteSpace(systemMember.SerialNumber) ? Constants.DefaultValue : systemMember.SerialNumber },
				{ Parameter.productname_502, String.IsNullOrWhiteSpace(systemMember.Model) ? Constants.DefaultValue : systemMember.Model },
				{ Parameter.servername_505, String.IsNullOrWhiteSpace(systemMember.HostName) ? Constants.DefaultValue : systemMember.HostName },
				{ Parameter.productid_506, String.IsNullOrWhiteSpace(systemMember.SKU) ? Constants.DefaultValue : systemMember.SKU },
				{ Parameter.uuid_507, String.IsNullOrWhiteSpace(systemMember.UUID) ? Constants.DefaultValue : systemMember.UUID },
				{ Parameter.systemrom_508, String.IsNullOrWhiteSpace(systemMember.BiosVersion) ? Constants.DefaultValue : systemMember.BiosVersion },
				{ Parameter.uidindicator_515, String.IsNullOrWhiteSpace(systemMember.IndicatorLED) ? Constants.DefaultValue : systemMember.IndicatorLED },
				{ Parameter.serverpower_516, String.IsNullOrWhiteSpace(systemMember.PowerState) ? Constants.DefaultValue : systemMember.PowerState },
				{ Parameter.backupromdate_509, -1 },
				{ Parameter.systemromdate_521, -1 },
				{ Parameter.systemstatusstate_513, String.IsNullOrWhiteSpace(systemMember.Status?.State) ? Constants.DefaultValue : systemMember.Status.State },
				{ Parameter.systemstatushealth_514, String.IsNullOrWhiteSpace(systemMember.Status?.Health) ? Constants.DefaultValue : systemMember.Status.Health },
				{ Parameter.systemagentlessmanagementservice_517, Constants.DefaultValue },
				{ Parameter.bioshardwarestatus_533, Constants.DefaultValue },
				{ Parameter.fanredundancy_534, Constants.DefaultValue },
				{ Parameter.fansstatus_535, Constants.DefaultValue },
				{ Parameter.memorystatus_536, Constants.DefaultValue },
				{ Parameter.powersuppliesmismatch_538, Constants.DefaultValue },
				{ Parameter.powersuppliesstatus_539, Constants.DefaultValue },
				{ Parameter.powersuppliesredundancy_540, Constants.DefaultValue },
				{ Parameter.processorsstatus_541, Constants.DefaultValue },
				{ Parameter.storagestatus_542, Constants.DefaultValue },
				{ Parameter.temperaturesstatus_543, Constants.DefaultValue },
				{ Parameter.smartstoragebatterystatus_544, Constants.DefaultValue },
				{ Parameter.virtualprofile_545, Constants.DefaultValue },
				{ Parameter.virtualuuid_546, Constants.DefaultValue },
				{ Parameter.systemusagecpuutil_550, -1 },
				{ Parameter.systemusagecpuicutil_551, -1 },
				{ Parameter.systemusagememorybusutil_552, -1 },
				{ Parameter.systemusageiobusutil_553, -1 },
				{ Parameter.systemusagecpu0power_554, -1 },
				{ Parameter.systemusagecpu1power_555, -1 },
				{ Parameter.systemusagecpu2power_556, -1 },
				{ Parameter.systemusagecpu3power_557, -1 },
				{ Parameter.systemusageavgcpu0freq_558, -1 },
				{ Parameter.systemusageavgcpu1freq_559, -1 },
				{ Parameter.systemusageavgcpu2freq_560, -1 },
				{ Parameter.systemusageavgcpu3freq_561, -1 },
			};

			ParseHpe(systemMember);

			if (dataToSet.Count > 0)
			{
				protocol.SetParameters(dataToSet.Keys.ToArray(), dataToSet.Values.ToArray());
			}
		}

		private void AddParameterIfNotNull(string input, int parameterId)
		{
			if (!String.IsNullOrWhiteSpace(input))
			{
				dataToSet[parameterId] = input;
			}
		}

		private void ParseHpe(JsonObjects.SystemMember.RootObject systemMember)
		{
			if (systemMember.Oem?.Hpe == null)
			{
				return;
			}

			ParseHpeBios(systemMember);

			ParseHpeAggregateHealthStatus(systemMember);

			ParseHpeSystemUsage(systemMember);

			AddParameterIfNotNull(systemMember.Oem.Hpe.VirtualProfile, Parameter.virtualprofile_545);
			AddParameterIfNotNull(systemMember.Oem.Hpe.VirtualUUID, Parameter.virtualuuid_546);
		}

		private void ParseHpeAggregateHealthStatus(JsonObjects.SystemMember.RootObject systemMember)
		{
			if (systemMember.Oem.Hpe.AggregateHealthStatus == null)
			{
				return;
			}

			AddParameterIfNotNull(systemMember.Oem.Hpe.AggregateHealthStatus.AgentlessManagementService, Parameter.systemagentlessmanagementservice_517);
			AddParameterIfNotNull(systemMember.Oem.Hpe.AggregateHealthStatus.BiosOrHardwareHealth?.Status?.Health, Parameter.bioshardwarestatus_533);
			AddParameterIfNotNull(systemMember.Oem.Hpe.AggregateHealthStatus.FanRedundancy, Parameter.fanredundancy_534);
			AddParameterIfNotNull(systemMember.Oem.Hpe.AggregateHealthStatus.Fans?.Status?.Health, Parameter.fansstatus_535);
			AddParameterIfNotNull(systemMember.Oem.Hpe.AggregateHealthStatus.Memory?.Status?.Health, Parameter.memorystatus_536);
			AddParameterIfNotNull(systemMember.Oem.Hpe.AggregateHealthStatus.Network?.Status?.Health, Parameter.networkstatus_537);
			AddParameterIfNotNull(systemMember.Oem.Hpe.AggregateHealthStatus.PowerSupplies?.PowerSuppliesMismatch, Parameter.powersuppliesmismatch_538);
			AddParameterIfNotNull(systemMember.Oem.Hpe.AggregateHealthStatus.PowerSupplies?.Status?.Health, Parameter.powersuppliesstatus_539);
			AddParameterIfNotNull(systemMember.Oem.Hpe.AggregateHealthStatus.PowerSupplyRedundancy, Parameter.powersuppliesredundancy_540);
			AddParameterIfNotNull(systemMember.Oem.Hpe.AggregateHealthStatus.Processors?.Status?.Health, Parameter.processorsstatus_541);
			AddParameterIfNotNull(systemMember.Oem.Hpe.AggregateHealthStatus.Storage?.Status?.Health, Parameter.storagestatus_542);
			AddParameterIfNotNull(systemMember.Oem.Hpe.AggregateHealthStatus.Temperatures?.Status?.Health, Parameter.temperaturesstatus_543);
			AddParameterIfNotNull(systemMember.Oem.Hpe.AggregateHealthStatus.SmartStorageBattery?.Status?.Health, Parameter.smartstoragebatterystatus_544);
		}

		private void ParseHpeBios(JsonObjects.SystemMember.RootObject systemMember)
		{
			if (systemMember.Oem.Hpe.Bios == null)
			{
				return;
			}

			if (systemMember.Oem.Hpe.Bios.Backup != null)
			{
				dataToSet[Parameter.backupromdate_509] = ParseToOADateOrDefault(systemMember.Oem.Hpe.Bios.Backup.Date, "MM/dd/yyyy", -1);
			}

			if (systemMember.Oem.Hpe.Bios.Current != null)
			{
				dataToSet[Parameter.systemromdate_521] = ParseToOADateOrDefault(systemMember.Oem.Hpe.Bios.Current.Date, "MM/dd/yyyy", -1);
			}
		}

		private void ParseHpeSystemUsage(JsonObjects.SystemMember.RootObject systemMember)
		{
			if (systemMember.Oem.Hpe.SystemUsage == null)
			{
				return;
			}

			dataToSet[Parameter.systemusagecpuutil_550] = systemMember.Oem.Hpe.SystemUsage.CpuUtil;
			dataToSet[Parameter.systemusagecpuicutil_551] = systemMember.Oem.Hpe.SystemUsage.CpuicUtil;
			dataToSet[Parameter.systemusagememorybusutil_552] = systemMember.Oem.Hpe.SystemUsage.MemoryBusUtil;
			dataToSet[Parameter.systemusageiobusutil_553] = systemMember.Oem.Hpe.SystemUsage.IoBusUtil;

			if (systemMember.Oem.Hpe.SystemUsage.Cpu0Power.HasValue)
			{
				dataToSet[Parameter.systemusagecpu0power_554] = systemMember.Oem.Hpe.SystemUsage.Cpu0Power;
			}

			if (systemMember.Oem.Hpe.SystemUsage.Cpu1Power.HasValue)
			{
				dataToSet[Parameter.systemusagecpu1power_555] = systemMember.Oem.Hpe.SystemUsage.Cpu1Power;
			}

			if (systemMember.Oem.Hpe.SystemUsage.Cpu2Power.HasValue)
			{
				dataToSet[Parameter.systemusagecpu2power_556] = systemMember.Oem.Hpe.SystemUsage.Cpu2Power;
			}

			if (systemMember.Oem.Hpe.SystemUsage.Cpu3Power.HasValue)
			{
				dataToSet[Parameter.systemusagecpu3power_557] = systemMember.Oem.Hpe.SystemUsage.Cpu3Power;
			}

			if (systemMember.Oem.Hpe.SystemUsage.AvgCpu0Freq.HasValue)
			{
				dataToSet[Parameter.systemusageavgcpu0freq_558] = systemMember.Oem.Hpe.SystemUsage.AvgCpu0Freq;
			}

			if (systemMember.Oem.Hpe.SystemUsage.AvgCpu1Freq.HasValue)
			{
				dataToSet[Parameter.systemusageavgcpu1freq_559] = systemMember.Oem.Hpe.SystemUsage.AvgCpu1Freq;
			}

			if (systemMember.Oem.Hpe.SystemUsage.AvgCpu2Freq.HasValue)
			{
				dataToSet[Parameter.systemusageavgcpu2freq_560] = systemMember.Oem.Hpe.SystemUsage.AvgCpu2Freq;
			}

			if (systemMember.Oem.Hpe.SystemUsage.AvgCpu3Freq.HasValue)
			{
				dataToSet[Parameter.systemusageavgcpu3freq_561] = systemMember.Oem.Hpe.SystemUsage.AvgCpu3Freq;
			}
		}
	}
}

