	private static void ProcessTrapForTable(SLProtocolExt protocol, TrapParameter param, ReadOnlyTrapInfoVariableBindingCollection bindings)
	{
		// Index is the full binding oid minus the generic binding oid specified in the map
		var tableIndex = param.BindingPosition != null ? bindings[Convert.ToInt32(param.BindingPosition)].Oid.Substring(param.BindingOid.Length + 1) : "0";
		var bindingValue = param.BindingPosition != null ? bindings[Convert.ToInt32(param.BindingPosition)].Value : "0";

		switch (param.PID)
		{
			case Parameter.Drivearrayphysicaldrivetable.Pid.drivearrayphysicaldrivetablestatus_11603:
				var physicalDriveRow = new DrivearrayphysicaldrivetableQActionRow();
				physicalDriveRow.Drivearrayphysicaldrivetableindex_11601 = tableIndex;
				physicalDriveRow.Drivearrayphysicaldrivetablestatus_11603 = bindingValue;
				protocol.drivearrayphysicaldrivetable.SetRow(physicalDriveRow);

				break;
			case Parameter.Drivearraylogicaldrivetable.Pid.drivearraylogicaldrivetablestatus_11502:
				var logicalDriveRow = new DrivearraylogicaldrivetableQActionRow();
				logicalDriveRow.Drivearraylogicaldrivetableindex_11501 = tableIndex;
				logicalDriveRow.Drivearraylogicaldrivetablestatus_11502 = bindingValue;
				protocol.drivearraylogicaldrivetable.SetRow(logicalDriveRow);
				break;

			case Parameter.Cachemoduleboardtable.Pid.cachemoduleboardtablebattery_11403:
				var cacheModuleBoardRow = new CachemoduleboardtableQActionRow();
				cacheModuleBoardRow.Cachemoduleboardtableindex_11401 = tableIndex;
				cacheModuleBoardRow.Cachemoduleboardtablebattery_11403 = bindingValue;
				protocol.cachemoduleboardtable.SetRow(cacheModuleBoardRow);
				break;

			case Parameter.Cputable.Pid.cputablestatus_7203:
				var cpuRow = new CputableQActionRow();
				cpuRow.Cputableindex_7201 = tableIndex;
				cpuRow.Cputablestatus_7203 = bindingValue;
				protocol.cputable.SetRow(cpuRow);
				break;

			case Parameter.Softwarerunningtable.Pid.softwarerunningtablestate_13104:
				// This trap does not contain a binding or information for 'state'. Only 'status'
				// We need to repoll the table
				protocol.CheckTrigger(13100);
				break;

			case Parameter.Storagetable.tablePid:
				// Repoll storage tables so the alarms pop-up
				protocol.CheckTrigger(11700);
				break;

			default:
				protocol.Log("QA13 | That trap oid is not supported.", LogType.Information, LogLevel.NoLogging);
				break;
		}
	}

	/// <summary>
	///     The QAction entry point.
	/// </summary>
	/// <param name="protocol">Link with SLProtocol process.</param>
	/// <param name="trapInfo">TrapInfo object from protocol.</param>
	public static void Run(SLProtocolExt protocol, object trapInfo)
	{
		try
		{
			// Load trap info
			TrapInfo trap = TrapInfo.FromTrapData(trapInfo);
			string trapOid = trap.Oid;
			protocol.Log($"QA{protocol.QActionID}|Run|Trap received: " + trapOid, LogType.DebugInfo, LogLevel.NoLogging);

			// Find parameter to update based on oid.
			var param = GetTrapParameters.FirstOrDefault(e => e.OidValueMap.Any(kv => kv.Key == trapOid));
			if (param == null)
			{
				return;
			}

			// Get predefined value for trap if it exists
			int? trapValue = param.OidValueMap.First(x => x.Key == trapOid).Value;

			if (trapValue != null)
			{
				protocol.SetParameter(param.PID, trapValue);
			}
			else
			{
				ProcessTrapForTable(protocol, param, trap.VariableBindings);
			}
		}
		catch (Exception ex)
		{
			protocol.Log("QA" + protocol.QActionID + "|" + protocol.GetTriggerParameter() + "|Run|Exception thrown:" + Environment.NewLine + ex, LogType.Error, LogLevel.NoLogging);
		}
	}

	private sealed class TrapParameter
	{
		public int PID { get; set; }

		public int? BindingPosition { get; set; }

		public string BindingOid { get; set; }

		public Dictionary<string, int?> OidValueMap { get; set; }
	}
}

