/// <summary>
/// DataMiner QAction Class: HTTP Request List Iterator.
/// </summary>
public class QAction
{
	/// <summary>
	/// The QAction entry point.
	/// </summary>
	/// <param name="protocol">Link with SLProtocol process.</param>
	public static void Run(SLProtocol protocol)
	{
		int trigger = protocol.GetTriggerParameter();
		try
		{
			// This is needed. The device can't handle a lot of requests.
			Thread.Sleep(100);
			Iteration.Iterate(protocol, trigger);
		}
		catch (Exception ex)
		{
			protocol.Log("QA" + protocol.QActionID + "|" + trigger + "|Error while Iterating a polling loop. Exception: " + ex, LogType.Error, LogLevel.NoLogging);
		}
	}
}

