/// <summary>
/// DataMiner QAction Class: Response HPILOGen10.Parser.
/// </summary>
public static class QAction
{
	/// <summary>
	/// The QAction entry point.
	/// </summary>
	/// <param name="protocol">Link with SLProtocol process.</param>
	public static void Run(SLProtocol protocol)
	{
		int trigger = protocol.GetTriggerParameter();
		try
		{
			object[] data = (object[])protocol.GetParameters(new uint[] { Parameter.redfishapistatuscode_3, (uint)trigger });

			string statusCode = Convert.ToString(data[0]);
			string response = Convert.ToString(data[1]);

			// This condition is purely to prevent QA from executing when a response is string.empty.
			// This value is used to clear some of the replies received from the device in order to "force Refresh" some data.
			// For instance to get all the ports states refresh we need to loop through the ports given by the Get Network Adapters List
			// The Reply from Get Network Adapters List is most likely to be always the same answer so if a parameter remains unchanged it won't trigger this QA.
			// Therefore we set that reply value with string.Empty to clear the parameter content in order for it to "change" upon executing the group Get Network Adapters List.
			if (String.IsNullOrWhiteSpace(response) || response.Contains("ResourceNotReadyRetry"))
			{
				return;
			}

			if (!statusCode.Contains("HTTP/1.1 200"))
			{
				protocol.Log("QA" + protocol.QActionID + "|" + trigger + "|Status Code Received: " + statusCode + "|Link:" + protocol.GetParameter(trigger - 500) + "\n|Response:" + response, LogType.Error, LogLevel.NoLogging);
				return;
			}

			response = response.Replace("@odata.", "Data_"); // needs to be done in order to avoid json HPILOGen10.Parser errors.
			switch (trigger)
			{
				case Parameter.responsegetsystem_1500:
					Parser.Systems(protocol, response);
					return;

				case Parameter.responsegetsystemmember_1501:
					var systemMemberParser = new SystemMemberParser(protocol);
					systemMemberParser.Parse(response);
					return;

				case Parameter.responsegetsystemsmemorylist_1502:
					Parser.SystemsMemoryList(protocol, response, trigger);
					return;

				case Parameter.responsegetredfishroot_1503:
					Parser.Root(protocol, response);
					return;

				case Parameter.responsegetchassis_1512:
					Parser.Chassis(protocol, response);
					return;

				case Parameter.responsegetsystemsfirmwareinventory_1527:
					Parser.FirmwareInfo(protocol, response);
					return;

				case Parameter.responsegetpciinfo_1528:
					Parser.PciInfo(protocol, response);
					return;

				case Parameter.responsegetsessions_1530:
					Parser.SessionList(protocol, response);
					return;

				case Parameter.responsegetsystemssinglearraycontroller_1532:
					Parser.SystemsSingleSmartStorageArrayController(protocol, response);
					return;

				case Parameter.responsegetsystemssinglesmartstoragearraycontrollerslogicaldriver_1534:
					Parser.SystemsSingleSmartStorageArrayControllerLogicalDriver(protocol, response);
					return;

				case Parameter.responsegetsystemssinglesmartstoragearraycontrollersdiskdrive_1536:
					Parser.SystemsSingleSmartStorageArrayControllerDiskDrive(protocol, response);
					return;

				case Parameter.responsegetsystemssinglesmartstoragearraycontrollersstorageenclosures_1538:
					Parser.SystemsSingleSmartStorageArrayControllerStorageEnclosure(protocol, response);
					return;

				case Parameter.responsegetsystemsnetworkadapterslist_1505:
				case Parameter.responsepostgetbasenetworkadapters_1507:
					object[] data2 = (object[])protocol.GetParameters(new uint[] { Parameter.responsegetilointerfaces_1504, Parameter.responsepostgetbasenetworkadapters_1507 });
					string responseILOs = Convert.ToString(data2[0]);
					string responsebasenet = Convert.ToString(data2[1]);
					if (String.IsNullOrWhiteSpace(responseILOs) || String.IsNullOrWhiteSpace(responsebasenet))
					{
						return;
					}

					if (!statusCode.Contains("HTTP/1.1 200"))
					{
						protocol.Log("QA" + protocol.QActionID + "|" + trigger + "|Status Code Received: " + statusCode + "|Link:" + protocol.GetParameter(trigger - 500) + "\n|Response:" + response, LogType.Error, LogLevel.NoLogging);
						return;
					}

					responseILOs = responseILOs.Replace("@odata.", "Data_"); // needs to be done in order to avoid json HPILOGen10.Parser errors.
					responsebasenet = responsebasenet.Replace("@odata.", "Data_"); // needs to be done in order to avoid json HPILOGen10.Parser errors.
					Parser.SystemsNetworkandIloInterfaces(protocol, response, responseILOs, responsebasenet);
					return;

				case Parameter.responsegetsystemsprocessorlist_1521:
					Parser.SystemsProcessorList(protocol, response);
					return;

				case Parameter.responsegetsystemssmartstoragearraycontrollerslist_1531:
				case Parameter.responsegetsystemssmartstoragearraycontrollerslogicaldriverslist_1533:
				case Parameter.responsegetsystemssmartstoragearraycontrollersdiskdriveslist_1535:
				case Parameter.responsegetsystemssmartstoragearraycontrollersstorageenclosureslist_1537:
					Parser.SystemsMemberIterator(protocol, response, trigger);
					protocol.SetParameter(trigger, String.Empty); // this is needed in order to force the parameter to clear and restart the loop on the rows.
					return;

				case Parameter.responsegetsystemssoftwareinventorylist_1539:
					Parser.SoftwareInventory(protocol, response);
					return;

				case Parameter.responsegetsystemslogservicesiml_1516:
					Parser.SystemsLogServicesIml(protocol, response);

					// protocol.SetParameter(1516, string.Empty);
					return;

				case Parameter.responsepostclearintegratedmanagementdetailslog_1542:
					protocol.SetParameter(trigger, String.Empty); // If the call was successful we need to clear this to make sure it triggers this QA
					Thread.Sleep(500); // need to give time to the device to clear the table.
					return;

				case Parameter.responsegetmanagers_1515:
					Parser.Managers(protocol, response);
					return;

				case Parameter.responsegetmanagersnetworkservice_1517:
					Parser.ManagersNetworkService(protocol, response);
					return;

				case Parameter.responsegetmanagersembeddedmedia_1518:
					Parser.ManagersEmbeddedMedia(protocol, response);
					return;

				case Parameter.responsepostrestartjsonapi_1544:
					string code = Convert.ToString(protocol.GetParameter(Parameter.jsonapistatuscode_7));
					if (!code.Contains("200"))
					{
						protocol.Log("QA" + protocol.QActionID + "|" + trigger + "|Status Code Received: " + code + "\n|Response:" + response, LogType.Error, LogLevel.NoLogging);
					}

					return;

				case Parameter.responsegetstoragecollection_1545:
					Parser.SystemsStorageCollection(protocol, response);
					break;

				case Parameter.responsegetstorage_1546:
					Parser.SystemsStorage(protocol, response);
					break;

				case Parameter.responsegetstoragedrives_1547:
					Parser.SystemsStorageDrive(protocol, response);
					break;

				default:
					protocol.Log("QA" + protocol.QActionID + "|The received trigger has no HPILOGen10.Parser assigned|", LogType.Error, LogLevel.NoLogging);
					return;
			}
		}
		catch (Exception e)
		{
			protocol.Log("QA" + protocol.QActionID + "|" + trigger + "|Request sent to link: " + protocol.GetParameter(trigger - 500) + "|Caught this exception.\n" + e + "\n|Received Response:\n" + Utils.ProtocolHelper.FormatJson((string)protocol.GetParameter(trigger)), LogType.Error, LogLevel.NoLogging);
		}
		finally
		{
			if (Iteration.IterateOnSingleContainsKey(trigger))
			{
				protocol.CheckTrigger(Iteration.GetIterateOnSingle(trigger));
			}
		}
	}
}

using System;
using HPILOGen10;
using Skyline.DataMiner.Scripting;

/// <summary>
/// DataMiner QAction Class: JSON API Response Parser.
/// </summary>
public class QAction
{
	/// <summary>
	/// The QAction entry point.
	/// </summary>
	/// <param name="protocol">Link with SLProtocol process.</param>
	public static void Run(SLProtocol protocol)
	{
		int trigger = protocol.GetTriggerParameter();
		try
		{
			object[] data = (object[])protocol.GetParameters(new uint[] { Parameter.jsonapistatuscode_7, (uint)trigger });

			string statusCode = Convert.ToString(data[0]);
			string response = Convert.ToString(data[1]);

			// This condition is purely to prevent QA from executing when a response is string.empty.
			// This value is used to clear some of the replies received from the device in order to "force Refresh" some data.
			// For instance to get all the ports states refresh we need to loop through the ports given by the Get Network Adapters List
			// The Reply from Get Network Adapters List is most likely to be always the same answer so if a parameter remains unchanged it won't trigger this QA.
			// Therefore we set that reply value with string.Empty to clear the parameter content in order for it to "change" upon executing the group Get Network Adapters List.
			if (String.IsNullOrWhiteSpace(response))
			{
				return;
			}

			if (String.IsNullOrWhiteSpace(statusCode) || !statusCode.Contains("HTTP/1.1 200"))
			{
				protocol.SetParameter(Parameter.connectionstatus, 0);
				protocol.Log("QA" + protocol.QActionID + "|" + trigger + "|Status Code Received: " + statusCode + "\n|Response:" + response, LogType.Error, LogLevel.NoLogging);
				return;
			}

			protocol.SetParameter(Parameter.connectionstatus, 1);

			switch (trigger)
			{
				case Parameter.responsepostloginsessionjsonapi_1506:
					Parser.JsonApiLoginSession(protocol, response);
					break;

				case Parameter.responsegetiloeventlogjsonapi_1541:
					Parser.JsonApiIloEventLog(protocol, response);
					protocol.SetParameter(trigger, String.Empty);
					break;

				default:
					protocol.Log("QA" + protocol.QActionID + "|Unexpected Trigger received.|", LogType.Error, LogLevel.NoLogging);
					break;
			}
		}
		catch (Exception e)
		{
			protocol.Log("QA" + protocol.QActionID + "|" + trigger + "|Request sent to link:" + protocol.GetParameter(trigger - 500) + "|Received Response:" + protocol.GetParameter(trigger) + "|Caught this exception." + e, LogType.Error, LogLevel.NoLogging);
		}
	}
}

using System;
using System.Collections.Generic;
using System.Linq;
using System.Text;
using HPILOGen10;
using Skyline.DataMiner.Scripting;

/// <summary>
/// DataMiner QAction Class: Response Parser.
/// </summary>
public class QAction
{
	private Dictionary<int, object> dataToSet;

	/// <summary>
	/// The QAction entry point.
	/// </summary>
	/// <param name="protocol">Link with SLProtocol process.</param>
	public void Run(SLProtocol protocol)
	{
		int trigger = protocol.GetTriggerParameter();
		dataToSet = new Dictionary<int, object>();
		try
		{
			switch (trigger)
			{
				case Parameter.buildauthenticationdata_102: // Build Login Request Data
					BuildUris(protocol);
					AuthenticationAssembly(protocol);
					break;

				case Parameter.username_100:
				case Parameter.password_101:
				case 1706: // Trigger Before
					AuthenticationAssembly(protocol);
					break;

				case 8:
					dataToSet.Add(Parameter.urigetiloeventlogjsonapi_1041, "json/ilo_event_log/page/0");
					dataToSet.Add(Parameter.iloeventlogoldestrecord_2009, 0);
					break;

				case 9:
					var busAddress = Utils.ProtocolHelper.GetBusAddress(protocol);

					dataToSet.Add(Parameter.urigetsystemslogservicesimlentries_1016, Constants.Redfish + Constants.Version + Constants.Systems + busAddress + "/" + "LogServices/IML/Entries/");
					dataToSet.Add(Parameter.integratedmanagementlogoldestrecord_2006, 0);
					break;

				case 591:
					BuildRestartParameters(protocol);
					break;

				case 593:
					BuildShutdownParameters(protocol);
					break;

				default:
					protocol.Log("QA" + protocol.QActionID + "|Unexpected Trigger Received.", LogType.Error, LogLevel.NoLogging);
					break;
			}

			protocol.SetParameters(dataToSet.Keys.ToArray(), dataToSet.Values.ToArray());
		}
		catch (Exception ex)
		{
			protocol.Log("QA" + protocol.QActionID + "|Trigger:" + trigger + "|Error occurred while building a request: " + ex, LogType.Error, LogLevel.NoLogging);
		}
		finally
		{
			dataToSet.Clear();
		}
	}

	private void BuildRestartParameters(SLProtocol protocol)
	{
		int value = Convert.ToInt32(protocol.GetParameter(Parameter.Write.btnrestart_590));
		if (value == 1)
		{
			dataToSet.Add(Parameter.uripostrestart_1044, "redfish/v1/Systems/1/Actions/ComputerSystem.Reset/");
			dataToSet.Add(Parameter.postrestartdata_1844, "{\"ResetType\": \"ForceRestart\"}");
			return;
		}

		if (value == 2)
		{
			dataToSet.Add(Parameter.uripostrestart_1044, "redfish/v1/Systems/1/Actions/ComputerSystem.Reset/");
			dataToSet.Add(Parameter.postrestartdata_1844, "{\"ResetType\": \"GracefulRestart\"}");
			return;
		}

		if (value == 3)
		{
			dataToSet.Add(Parameter.uripostrestart_1044, "redfish/v1/Systems/1/Actions/Oem/Hpe/HpeComputerSystemExt.SystemReset/");
			dataToSet.Add(Parameter.postrestartdata_1844, "{\"ResetType\": \"ColdBoot\"}");
			return;
		}

		protocol.Log($"QA{protocol.QActionID}|BuildRestartParameters|Trigger not supported: {value}", LogType.Error, LogLevel.NoLogging);
	}

	private void BuildShutdownParameters(SLProtocol protocol)
	{
		int value = Convert.ToInt32(protocol.GetParameter(Parameter.Write.btnshutdown_592));
		if (value == 1)
		{
			dataToSet.Add(Parameter.uripostrestart_1044, "redfish/v1/Systems/1/Actions/ComputerSystem.Reset/");
			dataToSet.Add(Parameter.postrestartdata_1844, "{\"ResetType\": \"GracefulShutdown\"}");
			return;
		}

		if (value == 2)
		{
			dataToSet.Add(Parameter.uripostrestart_1044, "redfish/v1/Systems/1/Actions/ComputerSystem.Reset/");
			dataToSet.Add(Parameter.postrestartdata_1844, "{\"ResetType\": \"On\"}");
			return;
		}

		protocol.Log($"QA{protocol.QActionID}|BuildRestartParameters|Trigger not supported: {value}", LogType.Error, LogLevel.NoLogging);
	}

	/// <summary>
	/// This method uses both username and password to create the MD5 hash for RedFish API and will also create the JSON object for the Login session on the JSON API.
	/// </summary>
	/// <param name="protocol">Link with Dataminer.</param>
	private void AuthenticationAssembly(SLProtocol protocol)
	{
		object[] data = (object[])protocol.GetParameters(new uint[] { Parameter.username_100, Parameter.password_101 });

		string userName = Convert.ToString(data[0]);
		string password = Convert.ToString(data[1]);

		byte[] encodeAsBytes = Encoding.ASCII.GetBytes(userName + ":" + password);

		string authorization = "Basic " + Convert.ToBase64String(encodeAsBytes);
		dataToSet.Add(Parameter.redfishhttpauthorization_103, authorization);
		dataToSet.Add(Parameter.postloginsessionrequestdata_1806, "{\"method\":\"login\",\"user_login\":\"" + userName + "\",\"password\":\"" + password + "\"}");
	}

	private void BuildUris(SLProtocol protocol)
	{
		dataToSet.Add(Parameter.urigetsystemmembers_1000, "redfish/v1/systems/");
		dataToSet.Add(Parameter.urigetredfishroot_1003, "redfish/v1/");
		dataToSet.Add(Parameter.urigetactivesessions_1030, "redfish/v1/SessionService/Sessions/?$expand=.");

		var busAddress = Utils.ProtocolHelper.GetBusAddress(protocol);

		string systemURI = Constants.Redfish + Constants.Version + Constants.Systems + busAddress + "/";
		string basenetworkURI = Constants.Redfish + Constants.Version + Constants.Systems + busAddress + "/" + Constants.BaseNetworkAdapters + Constants.Expand;
		string chassisURI = Constants.Redfish + Constants.Version + Constants.Chassis + busAddress + "/" + Constants.Expand;
		string networkadaptersURI = Constants.Redfish + Constants.Version + Constants.Systems + busAddress + "/" + Constants.EthernetCards + Constants.Expand;
		string firmwareURI = Constants.Redfish + Constants.Version + Constants.UpdateService + Constants.FirmwareInventory + Constants.Expand;
		string softwareURI = Constants.Redfish + Constants.Version + Constants.UpdateService + Constants.SoftwareInventory + Constants.Expand;
		string memoryURI = Constants.Redfish + Constants.Version + Constants.Systems + busAddress + "/" + Constants.Memory + Constants.Expand;
		string managersURI = Constants.Redfish + Constants.Version + Constants.Managers + busAddress + "/";
		string iloURI = Constants.Redfish + Constants.Version + Constants.Managers + busAddress + "/" + Constants.EthernetCards + Constants.Expand;
		string systemsprocessURI = Constants.Redfish + Constants.Version + Constants.Systems + busAddress + "/" + Constants.Processors + Constants.Expand;

		dataToSet.Add(Parameter.urigetsystemmember_1001, systemURI);

		// Systems
		dataToSet.Add(Parameter.urigetsystemsmemorylist_1002, memoryURI);
		dataToSet.Add(Parameter.urigetilointerfaces_1004, iloURI);
		dataToSet.Add(Parameter.urigetsystemsnetworkadapters_1005, networkadaptersURI);
		dataToSet.Add(Parameter.urigetbasenetworkadapters_1007, basenetworkURI);
		dataToSet.Add(Parameter.urigetmanagers_1015, managersURI);
		dataToSet.Add(Parameter.urigetmanagersnetworkservice_1017, managersURI + "NetworkService/");
		dataToSet.Add(Parameter.urigetmanagersembeddedmedia_1018, managersURI + "Embeddedmedia/");
		dataToSet.Add(Parameter.urigetsystemsprocessorlist_1021, systemsprocessURI);
		dataToSet.Add(Parameter.urigetsystemsfirmwareinventory_1027, firmwareURI);
		dataToSet.Add(Parameter.urigetsystemssmartstoragearraycontrollerslist_1031, systemURI + "SmartStorage/ArrayControllers/");
		dataToSet.Add(Parameter.urigetsystemssoftwareinventorylist_1039, softwareURI);
		dataToSet.Add(Parameter.urigetsystemslogservicesimlentries_1016, systemURI + "LogServices/IML/Entries/");
		dataToSet.Add(Parameter.uripostsystemslogservicesiml_1042, systemURI + "LogServices/IML/");
		dataToSet.Add(Parameter.urigetstoragecollection_1045, systemURI + "Storage/");

		// bios
		// PCIDevices
		// PCISlots
		// SecureBoot

		// CHASSIS
		dataToSet.Add(Parameter.urigetchassis_1012, chassisURI);

		// MANAGERS
		// ActiveHealthSystem
		// DateTime
		// EmbeddedMedia
		// dispatch
		// FederationsGroups
		// FederationPeers
		// LicenseService
		// SecurityService
		// UpdateService
		// sol.log.gz (VSPLogLocation)
		// NetowrkService
		// VirtualMedia

		// EthernetInterfaces

		// JSON API
		dataToSet.Add(Parameter.urigetiloeventlogjsonapi_1041, "json/ilo_event_log/page/0");
	}
}

using System;
using HPILOGen10;
using Skyline.DataMiner.Scripting;

/// <summary>
/// DataMiner QAction Class: Button Actions.
/// </summary>
public static class QAction
{
	private enum Action
	{
		Refresh = 0,
		Clear = 1,
	}

	/// <summary>
	/// The QAction entry point.
	/// </summary>
	/// <param name="protocol">Link with SLProtocol process.</param>
	public static void Run(SLProtocol protocol)
	{
		int trigger = protocol.GetTriggerParameter();
		object value = protocol.GetParameter(trigger);
		Action action = (Action)Convert.ToInt32(value);

		switch (trigger)
		{
			case Parameter.Write.integratedmanagementlogactions_2007:
				if (action == Action.Refresh)
				{
					IntegratedManagementLogActions.RefreshTable(protocol);
				}
				else
				{
					IntegratedManagementLogActions.ClearLog(protocol);
				}

				break;

			case Parameter.Write.iloeventlogactions_2010:
				if (action == Action.Refresh)
				{
					EventLogActions.RefreshTable(protocol);
				}
				else
				{
					EventLogActions.ClearLog(protocol);
				}

				break;

			default:
				protocol.Log("QA" + protocol.QActionID + "|Unexpected Trigger Received.", LogType.Error, LogLevel.NoLogging);
				break;
		}
	}
}
